INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (1, 'введение продналога', 'обеспечение предприятий рабочей силой через биржи труда', 'введение государственной хлебной монополии', 'проведение денежной реформы', 'С учетом чрезвычайно тяжелого военного, экономического и продовольственного положения в стране была разработана и осуществлялась политика «военного коммунизма». Главными элементами политики «военного коммунизма» являлись: национализация предприятий; макси', null, 1, 'Одним из элементов политики «военного коммунизма» являлось:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (2, '1918 г.', '1924 г.', '1926 г.', '1939 г.', 'Развитие экономики и культуры Беларуси, объединение белорусской нации в ее этнографических границах, укрепление национальной государственности требовало присоединения к БССР всех белорусских земель. На сопредельных территориях проживало больше белорусов, ', , 1, 'Обозначенные на карте границы БССР имела в конце:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (3, 'создание школ для национальных меньшинств', 'введение белорусского языка в качестве единого государственного', 'массовые политические репрессии против национальной интеллигенции', 'введение русского языка в качестве единого государственного', 'В ходе белорусизации учебных учреждений исходным принципом считалось обеспечение прав и возможностей каждой национальности учить детей на родном языке. К 1928 г. около 80 % школ было  переведено  на  белорусской  язык  обучения. Одновременно открылись шко', null, 1, 'Определите одно из направлений советской национальной политики в первой половине 1920-х гг. на территории Беларуси:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (4, 'машиностроения', 'химической промышленности', 'сферы услуг', 'деревообрабатывающей промышленности', 'С учетом достаточных запасов местного сырья, потребности в товарах народного потребления, удобных путей сообщения и производственных   традиций в годы первых пятилеток основное внимание в БССР уделялось топливной, деревообрабатывающей, бумажной, кожевенно', null, 1, 'С учетом производственных традиций в БССР в годы   первых пятилеток основное внимание уделялось развитию:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (5, 'создание Белорусской крестьянско-рабочей громады', 'установление авторитарного режима Ю. Пилсудского в Польше, в том числе и в Западной Беларуси', 'создание Товарищества белорусской школы', 'роспуск Коммунистической партии Западной Беларуси', 'В 1921 г. была создана массовая культурно-просветительская организация в Западной Беларуси – Товарищество белорусской школы. В 1925 г. была создана массовая легальная революционно-демократическая организация Западной Беларуси  – Белорусская  крестьянско-р', null, 1, 'Определите событие, которое произошло последним из перечисленных:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (6, 'подписать Рижский мирный договор', 'принять новую Конституцию', 'заключить пакт Молотова – Риббентропа', 'создать Коминтерн', 'Во второй половине 1930-х гг. возросла угроза германской фашисткой агрессии в Европе. СССР  предложил политику создания системы коллективной безопасности. Он проявил готовность сотрудничать со всеми европейскими странами для борьбы против германской агрес', null, 1, 'В результате неудачной попытки создания системы коллективной безопасности в Европе накануне Второй мировой войны СССР вынужден был:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (7, '1941 г.', '1942 г.', '1943 г.', '1944 г.', 'Для координации партизанской деятельности 30 мая 1942 г. был создан Центральный штаб партизанского движения под руководством П. Пономаренко. 9 сентября 1942 г. начал действовать Белорусский штаб партизанского движения, который возглавил П. Калинин', null, 1, 'Белорусский штаб партизанского движения был создан в:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (8, 'изменением структуры довоенного промышленного производства', 'опережающими темпами развития сельского хозяйства', 'развертыванием научно-технической революции', 'падением темпов экономического роста', 'В результате послевоенного восстановления изменилась структура промышленного производства. Удельный вес отраслей, которые преобладали  до  войны  (лесная,  пищевая,  легкая, деревообрабатывающая), значительно снизился. Основой в промышленности стала проду', null, 1, 'Экономическое развитие БССР во второй половине 1940-х – первой половине 1950-х гг. характеризовалось:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (9, 'отказ от социалистического образа жизни', 'ограничение руководящей роли коммунистической партии', 'преодоление последствий культа личности И. Сталина', 'улучшение взаимоотношений государства и религиозных конфессий', 'Изменения, произошедшие в общественно-политической жизни БССР во второй половине 1950-х – первой половине 1960-х гг., были направлены на преодоление последствий политического режима, который существовал при Сталине, культа его личности. Это способствовало', null, 1, 'Изменения в общественно-политической жизни БССР во второй половине 1950-х – первой половине 1960-х гг. были направлены на:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (10, 'проведение приватизации промышленных объектов под контролем государства', 'создание отраслей промышленности, связанных с научно-техническим прогрессом', 'приоритетное развитие легкой и перерабатывающей промышленности', 'введение элементов рыночной экономики', 'Пятилетние планы развития промышленности БССР в 1970-е  –  первой половине 1980-х гг. в целом выполнялись. Создавались и ее новые отрасли. Опережающими темпами росло производство продукции тех отраслей, которые определяли научно-технический прогресс: приб', null, 1, 'Определите характерную черту промышленного развития БССР в 1970-е – первой половине 1980-х гг.:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (11, 'Всебелорусское народное собрание', 'выборы депутатов на альтернативной основе', 'республиканский референдум', 'переговоры о создании СНГ', 'В 1990 г. согласно новому избирательному закону прошли выборы народных депутатов в Верховный и местные Советы народных депутатов БССР. Они впервые проводились на альтернативной основе, это значит на каждое место претендовало несколько кандидатов, а оконча', null, 1, 'В 1990 г. в БССР впервые состоялось(-ись, -ся)', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (12, '25 октября 1917 г.', '3 марта 1918 г.', '31 июля 1920 г.', '18 марта 1921 г.', '3 марта 1918 г. в Бресте был подписан Брестский мирный договор на очень тяжелых условиях. Территория Беларуси делилась на несколько частей. Белорусские земли на запад от линии Двинск – Лида – Пружаны – Брест отходили к Германии. Ее руководство ориентирова', null, 1, 'Брестский мирный договор был подписан:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (13, 'оккупацией ее территории германскими войсками', 'вступлением Беларуси и Литвы в Советский Союз', 'требованиями западноевропейских государств', 'захватом ее территории Польшей', '2–3 февраля 1919 г. состоялся I Всебелорусский съезд Советов. Он принял решение об объединении в одно государство Советской Социалистической Республики Беларуси и Литовской ССР. 27 февраля 1919 г. были созданы ЦИК и СНК Литбел. В состав этого государства ', null, 1, 'Литовско-Белорусская ССР прекратила свое существование в связи с:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (14, 'хозяйственный расчет', 'пятилетние планы развития', 'социалистическое соревнование', 'уравнительный принцип оплаты труда', 'Новая экономическая политика в промышленности предусматривала переход предприятий на хозяйственный расчет – форму хозяйствования, при которой предприятия покрывают издержки за счет своей прибыли. Происходит процесс самофинансирования предприятий. Государс', null, 1, 'В годы новой экономической политики в промышленности БССР вводился(-ись; -ось):', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (15, 'закончились средства на ее проведение', 'руководство СССР видело в ней националистическую угрозу', 'политика не соответствовала белорусскому национально-культурному возрождению', 'завершился процесс формирования белорусской нации', 'В проведении политики белорусизации имелись противоречия между позициями руководства СССР и Белорусской ССР. ЦК ВКП(б), ЦИК и СНК СССР в проведении политики белорусизации видели националистические проявления, центробежные тенденции, даже отказ от строител', null, 1, 'Проведение политики белорусизации в конце 1920-х гг. было остановлено, потому что:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (16, 'продолжила деятельность Коммунистическая партия Западной Беларуси', 'начали проводить коренизацию', 'зажиточные крестьяне получили государственную поддержку', 'ускорилось промышленное развитие', 'Воссоединение с БССР ускорило развитие промышленности Западной Беларуси. Восстанавливались и расширялись промышленные предприятия, велось строительство новых. В Западной Беларуси в основном развивались те отрасли промышленности, которые были обеспечены ме', null, 1, 'На территории Западной Беларуси после ее воссоединения с БССР (1939):', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (17, 'отказаться от эвакуации мирного населения и материальных ценностей', 'пойти на жесткую централизацию руководства государством', 'обратиться за помощью к странам Западной Европы', 'отдать приказ о массовом отступлении Красной Армии', '22 июня 1941 г. в 12 часов дня с Заявлением Советского правительства по радио выступил нарком иностранных дел В. Молотов, выразивший уверенность в победе над агрессором. Война с первых дней получила название «Великая Отечественная». По всей стране, в том ', null, 1, 'В первые дни Великой Отечественной войны правительство СССР было вынуждено:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (18, 'Белосток', 'Гродно', 'Брест', 'Минск', 'С 5 июля по 29 августа 1944 г. осуществлялся второй этап белорусской наступательной операции «Багратион». В ходе Люблин-Брестской операции войсками I Белорусского фронта под командованием К. Рокоссовского 28 июля 1944 г. был освобожден Брест. Оккупанты бы', null, 1, 'Последним из областных центров Беларуси от немецко-фашистских захватчиков был освобожден город:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (19, 'опережающие темпы выпуска товаров народного потребления', 'отставание темповразвития промышленности в сравнении с сельским хозяйством', 'отказ от обязательных плановых показателей', 'интенсивная механизация и электрификация сельского хозяйства', 'Важное значение для развития сельского хозяйства в БССР во второй половине 1950-х – первой половине 1960-х гг. имела его интенсивная механизация и электрификация. Увеличение капиталовложений обеспечило расширение машинно-тракторного парка, рост механизаци', null, 1, 'Определите характерную черту экономического развития БССР во второй половине 1950-х – первой половине 1960-х гг.:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (20, 'И. Мележ', 'И. Шамякин', 'В. Короткевич', 'И. Науменко', 'Иван Петрович Шамякин – народный писатель Беларуси, драматург, публицист. Общественный деятель. Участник Великой Отечественной войны. В романах «Сердце на ладони», «Снежные зимы» затронул проблему становления человека как личности в сложных общественных п', null, 1, 'Определите фамилию народного писателя Беларуси, автора романов «Сердце на ладони», «Злая звезда» и др.:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (21, '1985 г.', '1989 г.', '1990 г.', '1994 г.', 'Создание общественных движений и формирование многопартийности стали возможными только в условиях ослабления руководящей роли КПБ. В 1990 г. был принят Закон СССР «Об общественных объединениях», который закрепил права граждан на свободное объединение и со', null, 1, 'Закон СССР «Об общественных объединениях», который привел к созданию в государстве многопартийности, был принят в:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (22, '25 октября 1917 г.', '3 марта 1918 г.', '31 июля 1920 г.', '18 марта 1921 г.', '18 марта 1921 г. в Риге был подписан мирный договор между Советской Россией, Украиной и Польшей.   Представителей    Советской    Беларуси А. Червякова и И. Клишевского, как и делегацию БНР в составе В. Ластовского и В. Пигулевского, к переговорам в Риге ', null, 1, 'Рижский мирный договор был подписан:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (23, 'угроза интервенции со стороны Польши', 'необходимость проведения индустриализации', 'подготовка к созданию Советского Союза', 'требования западноевропейских государств', 'Угроза интервенции со стороны Польши вынудила советское руководство объединить ССРБ с Литовской ССР. 16 января 1919 г. ЦК РКП(б) принял решение включить Витебскую, Могилевскую и Смоленскую губернии в состав РСФСР, а на основе Минской, Гродненской, Виленск', null, 1, 'Определите причину объединения ССРБ с Литовской ССР:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (24, 'пятилетние планы развития', 'продналог', 'трудовая повинность', 'продразверстка', 'На Х съезде РКП(б), состоявшемся в марте 1921 г., была принята новая экономическая политика. Нэп включал в первую очередь переход от продразверстки к продналогу, размер которого был на 30–50 % ниже. Размер продналога рассчитывался с площади посевов и объя', null, 1, 'В годы новой экономической политики в промышленности БССР вводился(-ись; -ось):', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (25, 'введение обязательного среднего образования', 'создание Белорусской государственной консерватории', 'возвращение из-за границы на Родину культурных и научных деятелей', 'переход к преподаванию во всех учебных заведениях исключительно на белорусском языке', 'Центральный комитет КП(б)Б, ЦИК и СНК БССР проводили в жизнь ту национальную политику, основные направления которой были разработаны РКП(б) и ее структурами. Политика, проводившаяся в БССР с июля 1924 г., получила название политики белорусизации. Еще в фе', null, 1, 'Определите одно из мероприятий политики белорусизации, проводившейся в Беларуси в 1920-е гг.:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (26, 'замедлилось промышленное развитие', 'создавалась новая система образования', 'началась белорусизация', 'сохранилось осадническое землевладение', 'На территории Западной Беларуси после ее воссоединения с БССР осуществлялись преобразования в области культуры. Уже осенью 1939 г. было открыто много новых школ. Десятки тысяч детей крестьян и рабочих имели возможность бесплатно получить образование. Для ', null, 1, 'На территории Западной Беларуси после ее воссоединения с БССР (1939):', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (27, 'повышению организованности и эффективности партизанской борьбы', 'сокращению количества партизанских отрядов', 'установлению более тесных связей с движением Сопротивления в Западной Европе', 'уменьшению руководящей роли Компартии в партизанском и подпольном движении', 'В 1942 г. начался новый подъем партизанской борьбы. Она стала более организованной и эффективной. Этому способствовало создание в мае 1942 г. Центрального штаба партизанского движения (ЦШПД)', null, 1, 'Создание Белорусского штаба партизанского движения (1942) привело к:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (28, 'Витебск', 'Могилев', 'Минск', 'Гомель', 'Разгром гитлеровских войск на Курской дуге и успешное наступление Красной Армии летом – осенью 1943 г. создали условия для изгнания оккупантов с территории Беларуси. 26 ноября 1943 г. в ходе Гомельско-Речицкой операции войсками 11-й и 48-й армий Белорусск', null, 1, 'Первым из областных центров Беларуси от немецко-фашистских захватчиков был освобожден город:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (29, 'наличие тесных научных связей с западноевропейскими странами', 'отсутствие связей науки с производством', 'создание ряда новых научно-исследовательских институтов', 'отказ от административных методов управления наукой', 'После Великой Отечественной войны в Беларуси начала восстанавливаться материально- техническая база науки. В 1944 г. возобновила свою деятельность Академия наук БССР. В ее составе создавались новые научно-исследовательские институты: механизации и электри', null, 1, 'Определите характерную черту развития белорусской науки во второй половине 1940-х – первой половине 1950-х гг.:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (30, 'опережающее развитие машиностроения', 'отсутствие квалифицированной рабочей силы', 'введение рыночных механизмов регулирования экономических отношений', 'переход к отраслевой системе управления экономикой', 'Во второй половине 1950-х гг. Н. Хрущев поставил задачу в сжатый срок догнать и перегнать крупные капиталистические страны по производству важнейшей продукции на душу населения. Первоочередное внимание уделялось развитию тяжелой промышленностию. Участие Б', null, 1, 'Для экономического развития БССР во второй половине 1950-х – первой половине 1960-х гг. было (был) характерно(-ен):', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (31, 'И. Мележ', 'И. Шамякин', 'В. Короткевич', 'И. Науменко', 'В ряду произведений белорусской литературы второй половины 1950-х – первой половины 1980-х гг. нашли художественное воплощение многочисленные исторические события. В числе таких произведений романы И. Мележа «Люди на болоте», «Дыхание грозы», «Метели, дек', null, 1, 'Определите фамилию народного писателя Беларуси, автора трилогии «Полесская хроника»:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (32, '1985 г.', '1989 г.', '1990 г.', '1994 г.', 'Последней попыткой возвратить страну в доперестроечное время стал так называемый августовский путч 1991 г. Он был организован группой высших партийных и государственных руководителей в Москве в то время, когда руководитель государства М. Горбачев находилс', null, 1, 'Постановление Верховного Совета БССР «О временном приостановлении деятельности КПСС – КПБ на территории Беларуси» было принято в:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (33, 'увядзенне продпадатка', 'забеспячэнне прадпрыемстваў рабочай сілай праз біржы працы', 'ўвядзенне дзяржаўнай хлебнай манаполіі', 'правядзенне грашовай рэформы', 'З улікам надзвычай цяжкага ваеннага, эканамічнага і харчовага становішча ў краіне была распрацавана і ажыццяўлялася палітыка «ваеннага камунізму». Галоўнымі элементамі палітыкі «ваеннага камунізму» з''яўляліся: нацыяналізацыя прадпрыемстваў; максімальная ц', null, 2, 'Адным з элементаў палітыкі "ваеннага камунізму" з''яўлялася:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (34, '1918 г.', '1924 г.', '1926 г.', '1939 г.', 'Развіццё эканомікі і культуры Беларусі, аб''яднанне беларускай нацыі ў яе этнаграфічных межах, умацаванне нацыянальнай дзяржаўнасці патрабавала далучэння да БССР усіх беларускіх зямель. На сумежных тэрыторыях пражывала больш беларусаў, чым непасрэдна ў БСС', , 2, 'Пазначаныя на карце межы БССР мела ў канцы:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (35, 'стварэнне школ для нацыянальных меншасцяў', 'ўвядзенне беларускай мовы ў якасці адзінай дзяржаўнай', 'масавыя палітычныя рэпрэсіі супраць нацыянальнай інтэлігенцыі', 'увядзенне рускай мовы ў якасці адзінай дзяржаўнай', 'Падчас беларусізацыі навучальных устаноў зыходным прынцыпам лічылася забеспячэнне правоў і магчымасцяў кожнай нацыянальнасці вучыць дзяцей на роднай мове. Да 1928 г. каля 80% школ было перакладзена на беларускую мову навучання. Адначасова адкрыліся школы ', null, 2, 'Вызначце адзін з кірункаў савецкай нацыянальнай палітыкі ў першай палове 1920-х гг. на тэрыторыі Беларусі:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (36, 'машынабудаванне', 'хімічнай прамысловасці', 'сферы паслуг', 'дрэваапрацоўчай прамысловасці', 'З улікам дастатковых запасаў мясцовай сыравіны, патрэбнасці ў таварах народнага спажывання, зручных шляхоў зносін і вытворчых традыцый у гады першых пяцігодак асноўная ўвага ў БССР надавалася паліўнай, дрэваапрацоўчай, папяровай, гарбарнай, швейнай, абутк', null, 2, 'З улікам вытворчых традыцый у БССР у гады першых пяцігодак асноўная ўвага надавалася развіццю:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (37, 'стварэнне Беларускай сялянска-рабочай грамады', 'усталяванне аўтарытарнага рэжыму Ю. Пілсудскага ў Польшчы, у тым ліку і ў Заходняй Беларусі', 'стварэнне Таварыства беларускай школы', 'роспуск Камуністычнай партыі Заходняй Беларусі', 'У 1921 г. была створана масавая культурна-асветніцкая арганізацыя ў Заходняй Беларусі-Таварыства беларускай школы. У 1925 г. была створана масавая легальная рэвалюцыйна-дэмакратычная арганізацыя Заходняй Беларусі – Беларуская сялянска-рабочая грамада. У т', null, 2, 'Вызначце падзею, якое адбылося апошнім з пералічаных:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (38, 'падпісаць Рыжскі мірны дагавор', 'прыняць новую Канстытуцыю', 'заключыць пакт Молатава-Рыбентропа', 'стварыць Камінтэрн', 'У другой палове 1930 - х гг. узрасла пагроза германскай фашысцкай агрэсіі ў Еўропе. СССР прапанаваў палітыку стварэння сістэмы калектыўнай бяспекі. Ён праявіў гатоўнасць супрацоўнічаць з усімі еўрапейскімі краінамі для барацьбы супраць германскай агрэсіі.', null, 2, 'У выніку няўдалай спробы стварэння сістэмы калектыўнай бяспекі ў Еўропе напярэдадні Другой сусветнай вайны СССР вымушаны быў:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (39, '1941 г.', '1942 г.', '1943 г.', '1944 г.', 'Для каардынацыі партызанскай дзейнасці 30 мая 1942 г. быў створаны Цэнтральны штаб партызанскага руху пад кіраўніцтвам П. Панамарэнкі. 9 верасня 1942 г. пачаў дзейнічаць Беларускі штаб партызанскага руху, які ўзначаліў П. Калінін', null, 2, 'Беларускі штаб партызанскага руху быў створаны ў:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (40, 'змяненнем структуры даваеннага прамысловай вытворчасці', 'апераджальнымі тэмпамі развіцця сельскай гаспадаркі', 'разгортваннем навукова-тэхнічнай рэвалюцыі', 'падзеннем тэмпаў эканамічнага росту', 'У выніку пасляваеннага аднаўлення змянілася структура прамысловай вытворчасці. Удзельная вага галін, якія пераважалі да вайны (лясная, харчовая, лёгкая, дрэваапрацоўчая), значна знізілася. Асновай у прамысловасці стала прадукцыя машынабудавання і металаап', null, 2, 'Эканамічнае развіццё БССР у другой палове 1940-х – першай палове 1950-х гг. характарызавалася:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (41, 'адмову ад сацыялістычнага ладу жыцця', 'ограничение руководящей роли коммунистической партии', 'пераадоленне наступстваў культу асобы I. Сталіна', 'паляпшэнне ўзаемаадносін дзяржавы і рэлігійных канфесій', 'Змены, якія адбыліся ў грамадска-палітычным жыцці БССР у другой палове 1950 – х-першай палове 1960-х гг., былі накіраваныя на пераадоленне наступстваў палітычнага рэжыму, які існаваў пры Сталіне, культу яго асобы. Гэта спрыяла адноснай дэмакратызацыі і аз', null, 2, 'Змены ў грамадска-палітычным жыцці БССР у другой палове 1950 – х-першай палове 1960-х гг. былі накіраваны на:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (42, 'правядзенне прыватызацыі прамысловых аб''ектаў пад кантролем дзяржавы', 'стварэнне галін прамысловасці, звязаных з навукова-тэхнічным прагрэсам', 'прыярытэтнае развіццё лёгкай і перапрацоўчай прамысловасці', 'увядзенне элементаў рыначнай эканомікі', 'Пяцігадовыя планы развіцця прамысловасці БССР у 1970-я-першай палове 1980-х гг. У цэлым выконваліся. Ствараліся і яе новыя галіны. Апераджальнымі тэмпамі расла вытворчасць прадукцыі тых галін, якія вызначалі навукова-тэхнічны прагрэс: прыборабудаўніцтва, ', null, 2, 'Вызначыце характэрную рысу прамысловага развіцця БССР у 1970 – я-першай палове 1980-х гг.:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (43, 'Усебеларускі народны сход', 'выбары дэпутатаў на альтэрнатыўнай аснове', 'рэспубліканскі рэферэндум', 'перамовы аб стварэнні СНД', 'У 1990 г. паводле новага выбарчага закону прайшлі выбары народных дэпутатаў у Вярхоўны і мясцовыя Саветы народных дэпутатаў БССР. Яны ўпершыню праводзіліся на альтэрнатыўнай аснове, гэта значыць на кожнае месца прэтэндавала некалькі кандыдатаў, а канчатко', null, 2, 'У 1990 г. у БССР упершыню адбылося (- iсь, - ся)', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (44, '25 кастрычніка 1917 г.', '3 сакавіка 1918 г.', '31 ліпеня 1920 г.', '18 сакавіка 1921 г.', '3 сакавіка 1918 г. у Брэсце быў падпісаны Брэсцкі мірны дагавор на вельмі цяжкіх умовах. Тэрыторыя Беларусі дзялілася на некалькі частак. Беларускія землі на захад ад лініі Дзвінск-Ліда-Пружаны-Брэст адыходзілі да Германіі. Яе кіраўніцтва арыентавалася на', null, 2, 'Брэсцкі мірны дагавор быў падпісаны:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (45, 'акупацыяй яе тэрыторыі германскімі войскамі', 'уступленнем Беларусі і Літвы ў Савецкі Саюз', 'патрабаваннямі заходнееўрапейскіх дзяржаў', 'захопам яе тэрыторыі Польшчай', '2-3 лютага 1919 г. адбыўся I Усебеларускі з''езд саветаў. Ён прыняў рашэнне аб аб''яднанні ў адну дзяржаву Савецкай Сацыялістычнай Рэспублікі Беларусі і Літоўскай ССР. 27 люты 1919 г. Былі створаны ЦВК і СНК Литбел. У склад гэтай дзяржавы ўвайшлі Мінская, Г', null, 2, 'Літоўска-Беларуская ССР спыніла сваё існаванне ў сувязі з:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (46, 'гаспадарчы разлік', 'пяцігадовыя планы развіцця', 'сацыялістычнае спаборніцтва', 'ўраўняльны прынцып аплаты працы', 'Новая эканамічная палітыка ў прамысловасці прадугледжвала пераход прадпрыемстваў на гаспадарчы разлік – форму гаспадарання, пры якой прадпрыемствы пакрываюць выдаткі за кошт свайго прыбытку. Адбываецца працэс самафінансавання прадпрыемстваў. Дзяржаўныя пр', null, 2, 'У гады новай эканамічнай палітыкі ў прамысловасці БССР уводзіўся (- лася; -лicя):', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (47, 'скончыліся сродкі на яе правядзенне', 'кіраўніцтва СССР бачыла ў ёй нацыяналістычную пагрозу', 'палітыка не адпавядала беларускаму нацыянальна-культурнаму адраджэнню', 'завяршыўся працэс фарміравання беларускай нацыі', 'У правядзенні палітыкі беларусізацыі меліся супярэчнасці паміж пазіцыямі кіраўніцтва СССР і Беларускай ССР. ЦК ВКП (б), ЦВК і СНК СССР у правядзенні палітыкі беларусізацыі бачылі нацыяналістычныя праявы, цэнтрабежныя тэндэнцыі, нават адмову ад будаўніцтва', null, 2, 'Правядзенне палітыкі беларусізацыі ў канцы 1920-х гг. было спынена, таму што:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (48, 'працягнула дзейнасць Камуністычная партыя Заходняй Беларусі', 'пачалі праводзіць карэнізацыю', 'заможныя сяляне атрымалі дзяржаўную падтрымку', 'прамысловае развіццё паскорылася', 'Уз''яднанне з БССР паскорыла развіццё прамысловасці Заходняй Беларусі. Аднаўляліся і пашыраліся прамысловыя прадпрыемствы, вялося будаўніцтва новых. У Заходняй Беларусі ў асноўным развіваліся тыя галіны прамысловасці, якія былі забяспечаныя мясцовай сыраві', null, 2, 'На тэрыторыі Заходняй Беларусі пасля яе ўз''яднання з БССР (1939):', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (49, 'адмовіцца ад эвакуацыі мірнага насельніцтва і матэрыяльных каштоўнасцяў', 'пайсці на жорсткую цэнтралізацыю кіраўніцтва дзяржавай', 'звярнуцца за дапамогай да краін Заходняй Еўропы', 'аддаць загад аб масавым адступленні Чырвонай Арміі', '22 чэрвеня 1941 г. у 12 гадзін дня з заявай Савецкага ўрада па радыё выступіў наркам замежных спраў В. Молатаў, які выказаў упэўненасць у перамозе над агрэсарам. Вайна з першых дзён атрымала назву "Вялікая Айчынная". Па ўсёй краіне, у тым ліку і ў Беларус', null, 2, 'У першыя дні Вялікай Айчыннай вайны ўрад СССР быў вымушаны:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (50, 'Беласток', 'Гродна', 'Брэст', 'Мінск', 'З 5 ліпеня па 29 жніўня 1944 г. ажыццяўляўся другі этап беларускай наступальнай аперацыі "Баграціён". Падчас Люблін-Брэсцкай аперацыі войскамі I Беларускага фронту пад камандаваннем К. Ракасоўскага 28 ліпеня 1944 г. быў вызвалены Брэст. Акупанты былі цалк', null, 2, 'Апошнім з абласных цэнтраў Беларусі ад нямецка-фашысцкіх захопнікаў быў вызвалены горад:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (51, 'апераджальныя тэмпы выпуску тавараў народнага спажывання', 'адставанне тэмпаў развіцця прамысловасці ў параўнанні з сельскай гаспадаркай', 'адмова ад абавязковых планавых паказчыкаў', 'iнтэнсіўная механізацыя і электрыфікацыя сельскай гаспадаркі', 'Важнае значэнне для развіцця сельскай гаспадаркі ў БССР у другой палове 1950 – х-першай палове 1960-х гг. мела яго інтэнсіўная механізацыя і электрыфікацыя. Павелічэнне капіталаўкладанняў забяспечыла пашырэнне машынна-трактарнага парку, рост механізацыі в', null, 2, 'Вызначыце характэрную рысу эканамічнага развіцця БССР у другой палове 1950-х – першай палове 1960-х гг.:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (52, 'І. Мележ', 'І. Шамякін', 'У. Караткевіч', 'І. Навуменка', 'Іван Пятровіч Шамякін - народны пісьменнік Беларусі, драматург, публіцыст. Грамадскі дзеяч. Удзельнік Вялікай Айчыннай вайны. У раманах "Сэрца на далоні", "Снежныя зімы" закрануў праблему станаўлення чалавека як асобы ў складаных грамадскіх працэсах. У ап', null, 2, 'Вызначце прозвішча народнага пісьменніка Беларусі, аўтара раманаў "Сэрца на далоні»," Злая зорка " і інш.:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (53, '1985 г.', '1989 г.', '1990 г.', '1994 г.', 'Стварэнне грамадскіх рухаў і фарміраванне шматпартыйнасці сталі магчымымі толькі ва ўмовах паслаблення кіруючай ролі КПБ. У 1990 г. быў прыняты Закон СССР "Аб грамадскіх аб''яднаннях", які замацаваў правы грамадзян на свабоднае аб''яднанне і стварэнне паліт', null, 2, 'Закон СССР «Аб грамадскіх аб''яднаннях», які прывёў да стварэння шматпартыйнасці ў дзяржаве, быў прыняты ў:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (54, '25 кастрычніка 1917 г.', '3 сакавіка 1918 г.', '31 ліпеня 1920 г.', '18 сакавіка 1921 г.', '18 сакавіка 1921 г. у Рызе быў падпісаны мірны дагавор паміж Савецкай Расіяй, Украінай і Польшчай. Прадстаўнікоў савецкай Беларусі А. Чарвякова і і. Клішэўскага, як і дэлегацыю БНР у складзе В. Ластоўскага і В. Пігулеўскага, да перамоваў у Рызе не дапусці', null, 2, 'Рыжскі мірны дагавор быў падпісаны:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (55, 'пагроза інтэрвенцыі з боку Польшчы', 'неабходнасць правядзення індустрыялізацыі', 'падрыхтоўка да стварэння Савецкага Саюза', 'патрабаванні заходнееўрапейскіх дзяржаў', 'Пагроза інтэрвенцыі з боку Польшчы прымусіла савецкае кіраўніцтва аб''яднаць ССРБ з Літоўскай ССР. 16 студзеня 1919 г. ЦК РКП (б) прыняў рашэнне ўключыць Віцебскую, Магілёўскую і Смаленскую губерні ў склад РСФСР, а на аснове Мінскай, Гродзенскай, Віленскай', null, 2, 'Вызначце прычыну аб''яднання ССРБ з Літоўскай ССР:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (56, 'пяцігадовыя планы развіцця', 'харчовы падатак', 'працоўная павіннасць', 'харчразвёрстка', 'На Х з''ездзе РКП (б), які адбыўся ў сакавіку 1921 г., была прынятая новая эканамічная палітыка. Нэп уключаў у першую чаргу пераход ад харчразвёрсткi да харчовага падатку, памер якога быў на 30-50 % ніжэй. Памер харчовага падатку вылічваўся з плошчы пасева', null, 2, 'У гады новай эканамічнай палітыкі ў прамысловасці БССР уводзіўся (- лася; -лicя):', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (57, 'увядзенне абавязковай сярэдняй адукацыі', 'стварэнне Беларускай дзяржаўнай кансерваторыі', 'вяртанне з-за мяжы на радзіму культурных і навуковых дзеячаў', 'пераход да выкладання ва ўсіх навучальных установах выключна на беларускай мове', 'Цэнтральны Камітэт КП(б)Б, ЦВК і СНК БССР праводзілі ў жыццё тую нацыянальную палітыку, асноўныя напрамкі якой былі распрацаваны РКП(б) і яе структурамі. Палітыка, якая праводзілася ў БССР з ліпеня 1924 г., атрымала назву палітыкі беларусізацыі. Яшчэ ў лю', null, 2, 'Вызначце адно з мерапрыемстваў палітыкі беларусізацыі, якая праводзілася ў Беларусі ў 1920-я гг.:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (58, 'прамысловае развіццё замарудзілася', 'стваралася новая сістэма адукацыі', 'пачалася беларусізацыя', 'захавалася осадническое землеўладанне', 'На тэрыторыі Заходняй Беларусі пасля яе ўз''яднання з БССР ажыццяўляліся пераўтварэнні ў галіне культуры. Ужо восенню 1939 г. было адкрыта шмат новых школ. Дзесяткі тысяч дзяцей сялян і рабочых мелі магчымасць бясплатна атрымаць адукацыю. Для падрыхтоўкі с', null, 2, 'На тэрыторыі Заходняй Беларусі пасля яе ўз''яднання з БССР (1939):', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (59, 'павышэнню арганізаванасці і эфектыўнасці партызанскай барацьбы', 'скарачэнні колькасці партызанскіх атрадаў', 'усталяванню больш цесных сувязяў з рухам супраціву ў Заходняй Еўропе', 'памяншэння кіруючай ролі Кампартыі ў партызанскім і падпольным руху', 'У 1942 г. пачаўся новы ўздым партызанскай барацьбы. Яна стала больш арганізаванай і эфектыўнай. Гэтаму спрыяла стварэнне ў маі 1942 г. Цэнтральнага штаба партызанскага руху (ЦШПР) пры Стаўцы Вярхоўнага Галоўнакамандавання на чале з П. Панамарэнка і ў вера', null, 2, 'Стварэнне Беларускага штаба партызанскага руху (1942) прывяло да:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (60, 'Віцебск', 'Магілёў', 'Мінск', 'Гомель', 'Разгром гітлераўскіх войскаў на Курскай дузе і паспяховы наступ Чырвонай Арміі летам-восенню 1943 г. стварылі ўмовы для выгнання акупантаў з тэрыторыі Беларусі. 26 лістапада 1943 г. падчас Гомельска-Рэчыцкай аперацыі войскамі 11-й і 48-й армій Беларускага', null, 2, 'Першым з абласных цэнтраў Беларусі ад нямецка-фашысцкіх захопнікаў быў вызвалены горад:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (61, 'наяўнасць цесных навуковых сувязяў з заходнееўрапейскімі краінамі', 'адсутнасць сувязяў навукі з вытворчасцю', 'стварэнне шэрагу новых навукова-даследчых інстытутаў', 'адмова ад адміністрацыйных метадаў кіравання навукай', 'Пасля Вялікай Айчыннай вайны ў Беларусі пачала аднаўляцца матэрыяльна-тэхнічная база навукі. У 1944 г. аднавіла сваю дзейнасць Акадэмія навук БССР. У яе складзе ствараліся новыя навукова-даследчыя інстытуты: механізацыі і электрыфікацыі сельскай гаспадарк', null, 2, 'Вызначце характэрную рысу развіцця беларускай навукі ў другой палове 1940 – х-першай палове 1950-х гг.:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (62, 'апераджальнае развіццё машынабудавання', 'адсутнасць кваліфікаванай рабочай сілы', 'увядзенне рынкавых механізмаў рэгулявання эканамічных адносін', 'пераход да галіновай сістэмы кіравання эканомікай', 'У другой палове 1950-х гг. Н. Хрушчоў паставіў задачу ў сціснуты тэрмін дагнаць і перагнаць буйныя капіталістычныя краіны па вытворчасці найважнейшай прадукцыі на душу насельніцтва. Першачарговая ўвага надавалася развіццю цяжкай прамысловасцю. Удзел БССР ', null, 2, 'Для эканамічнага развіцця БССР у другой палове 1950-х – першай палове 1960-х гг. было характэрна:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (63, 'І. Мележ', 'І. Шамякін', 'У. Караткевіч', 'І. Навуменка', 'У шэрагу твораў беларускай літаратуры другой паловы 1950-х –першай паловы 1980-х гг. знайшлі мастацкае ўвасабленне шматлікія гістарычныя падзеі. У ліку такіх твораў раманы І. Мележа «Людзі на балоце», «Подых навальніцы», «Завеі, снежань», якія склалі трыл', null, 2, 'Вызначце прозвішча народнага пісьменніка Беларусі, аўтара трылогіі "Палеская хроніка":', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (64, '1985 г.', '1989 г.', '1990 г.', '1994 г.', 'Апошняй спробай вярнуць краіну ў даперабудовачны час стаў так званы жнівеньскі путч 1991 г. Ён быў арганізаваны групай вышэйшых партыйных і дзяржаўных кіраўнікоў у Маскве ў той час, калі кіраўнік дзяржавы М. Гарбачоў знаходзіўся на адпачынку ў Крыме. Няўд', null, 2, 'Пастанова Вярхоўнага Савета БССР «АБ часовым прыпыненні дзейнасці КПСС – КПБ на тэрыторыі Беларусі» было прынята ў:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (65, 'хроника', 'миф', 'житие', 'летопись', 'Житие  –  рассказ, в котором описывается жизнь святых, подвиги и страдания канонизованных церковью людей. На территории Беларуси житие известно с конца XIII в. («Житие и хождение Евфросинии Полоцкой»,«Житие Кирилла Туровского» и др.). Жития преимущественн', null, 1, 'Рассказ о жизненном пути и деятельности служителя церкви, религиозного деятеля - это', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (66, 'деревни Бердыж Чечерского района', 'города Петрикова Гомельской области', 'деревни Лабенщина Минского района', 'поселка Красносельский Волковысского района', 'На белорусских землях печи-домницы использовали для получения железа при сравнительно невысокой температуре. Для этого в них «варили» (нагревали) собранную железную руду.  Куски руды спекались, образуя пористую массу – крицу. Когда печь остывала, ее разру', null, 1, 'Остатки древней печи-домницы были найдены возле:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (67, 'торговля осуществлялась преимущественно без посредничества денег', 'с белорусских земель вывозили в основном товары ремесленного производства', 'через белорусские земли проходило большое количество важных торговых путей', 'отсутствовали торговые отношения с соседними государствами', 'Белорусские земли в VI–IX вв. находились в стороне от наиболее важных торговых путей, поэтому  местные  жители еще не занимались настоящей торговлей. Вероятно, что происходил обмен продуктов труда земледельцев на ремесленную продукцию. Таким же образом об', null, 1, 'Определите особенность развития торговли на белорусских землях в VI–IX вв.:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (68, '980 г.', '1005 г.', '1067 г.', '1127 г.', 'Полоцкие князья не желали подчиняться великому князю киевскому. В 1127 г. киевский князь Мстислав организовал поход на Полоцкую землю. В нем принимали участие семь русских князей со своими дружинами. Были заняты Изяславль  и Логойск. Опасность нависла над', null, 1, 'Поход на Полоцкую землю семи русских князей во главе с киевским князем Мстиславом состоялся в:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (69, 'притча', 'миф', 'хроника', 'летопись', 'Притча – небольшое религиозное произведение поучительного содержания. В ней содержатся религиозные или моральные поучения в иносказательной (аллегорической) форме. Притча близка к басне, но отличается от неё широтой обобщения, значимостью заключенной в пр', null, 1, 'Небольшое религиозное произведение поучительного содержания – это:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (70, 'деревни Бердыж Чечерского района', 'города Петрикова Гомельской области', 'деревни Лабенщина Минского района', 'поселка Красносельский Волковысского района', 'Кремень для изготовления орудий труда первобытные «шахтеры» добывали 2 тыс. лет до н. э. в примитивных шахтах, похожих на колодцы. Много таких шахт (глубиной 3–5 метров) было открыто возле поселка Красносельский, недалеко от Волковыска на Гродненщине. Най', null, 1, 'Древние кремнедобывающие шахты были найдены возле:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (71, 'через белорусские земли проходило большое количество важных торговых путей', 'основной формой торговли являлись ярмарки', 'с белорусских земель вывозили в основном товары ремесленного производства', 'средством платежа являлась пушнина', 'Белорусские земли в VI–IX вв. находились в стороне от наиболее важных торговых путей. Здесь не было месторождений драгоценных металлов или янтаря, пока еще слабо было развито ремесло. Местные жители еще не занимались настоящей торговлей. Вероятно, происхо', null, 1, 'Определите особенность развития торговли на белорусских землях в VI–IX вв.:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (72, '1067 г.', '1101 г.', '1129 г.', '1157 г.', 'Полоцкие князья не желали подчиняться Киеву. В 1129 г. они отказались участвовать в совместном походе на половцев. В ответ на это киевский князь Мстислав (сын Владимира Мономаха) захватил в плен непокорных полоцких князей вместе с семьями и выслал в Визан', null, 1, 'Киевский князь Мстислав захватил в плен и выслал в Византию полоцких князей в:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (73, 'переход к присваивающему хозяйству', 'строительство укрепленных поселений', 'начало изготовления глиняной посуды', 'появление индоевропейцев', 'В раннем железном веке, чтобы защитить себя и свое имущество, люди начали строить укрепленные поселения, так называемые городища. Городища строились на возвышенностях и укреплялись земляными валами, рвами, деревянными стенами. Это делалось по причине возм', null, 1, 'Для железного века на белорусских землях был (было) характерен(-о):', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (74, 'славянами', 'германцами', 'татарами', 'хазарами', 'Славяне постепенно заселяли территорию Беларуси. Они расчищали земли для выращивания хлеба, одно за другим строили свои поселения. Так происходила колонизация славянами белорусских земель. Но эта территория еще раньше была освоена племенами балтов. Отноше', null, 1, 'В VI–VIII вв. происходила колонизация белорусских земель:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (75, 'гриднями', 'тысяцкими', 'закупами', 'холопами', 'Закупы – категория зависимого крестьянства. Ими становились обедневшие крестьяне, которые брали у богатого человека купу (займ) и должны были работать в его хозяйстве, пока не отдадут этот займ. Феодал в отношении к закупам мог использовать разные формы п', null, 1, 'Крестьяне, попадавшие в зависимость, взяв займ у богатого человека, назывались:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (76, 'витражами', 'скульптурами', 'фресками', 'гравюрами', 'Фреска – техника монументальной живописи: раскраска водяными красками по свежей штукатурке. Высокого уровня фресковая живопись достигла в монументальном искусстве X–XII вв. Христианские церкви обычно украшались фресками и иконами. На территории Беларуси с', null, 1, 'Стены христианских храмов на белорусских землях в XI–XIII вв. обычно украшали:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (77, 'переход к присваивающему хозяйству', 'господство пашенного земледелия', 'начало изготовления глиняной посуды', 'усовершенствование изготовления каменных орудий труда', 'В бронзовом веке продолжали использоваться каменные орудия, которые были усовершенствованы. При их изготовлении больше, чем прежде, применялись шлифовка и сверление. Сверление облегчилось после того, как трубчатую кость начали приводить в движение лучково', null, 1, 'Для бронзового века на белорусских землях был (было) характерен(-но):', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (78, 'татарами', 'хазарами', 'балтами', 'германцами', 'Славяне смогли освоить территорию Беларуси только в конце Раннего средневековья. Но эта территория еще раньше была освоена племенами балтов. Отношения балтов и славян на территории Беларуси первоначально были мирными. Балтские племена были немногочисленны', null, 1, 'В VI–VIII вв. на территории Беларуси восточные славяне проживали совместно с:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (79, 'погосты', 'посады', 'детинцы', 'волоки', 'Одним из главных путей обеспечения князя и его дружины у восточных славян был сбор дани с подвластного населения, которое предоставляло князю мех, воск, продукты питания и т. д. Сбор князем дани с населения назывался полюдьем. Полюдье требовало личного пр', null, 1, 'Особые пункты, куда восточные славяне привозили дань князю, – это:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (80, 'витражами', 'миниатюрами', 'фресками', 'гравюрами', 'Средневековая живопись в ХI–ХIII вв. на белорусских землях была представлена фресками и книжными миниатюрами. Книжные миниатюры представляли собой красивые разноцветные рисунки-иллюстрации к событиям, о которых рассказывалось на страницах летописей и руко', null, 1, 'Летописи и древние книги в ХI– ХIII вв. украшали:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (81, 'хроніка', 'міт', 'жыціе', 'летапіс', 'Жыціе - аповяд, у якім апісваецца жыццё святых, подзвігі і пакуты канонизованных царквой людзей. На тэрыторыі Беларусі жыціе вядома з канца XIII ст. («Жыціе і хаджэнне Еўфрасінні Полацкай »,« Жыццяпіс Кірылы Тураўскага »і інш.). Жыціі пераважна ананімныя,', null, 2, 'Аповяд пра жыццёвы шлях і дзейнасць служыцеля царквы, рэлігійнага дзеяча - гэта', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (82, 'вёскі Бердыж Чачэрскага раёна', 'горада Петрыкава Гомельскай вобласці', 'вёскі Лабэншчына Мінскага раёна', 'пасёлка Краснасельскі Ваўкавыскага раёна', 'На беларускіх землях печы-домніцы выкарыстоўвалі для атрымання жалеза пры параўнальна невысокай тэмпературы. Для гэтага ў іх «варылі» (награвалі) сабраную жалезную руду. Кавалкі руды спекается, утвараючы кіпрую масу - крыцу. Калі печ астывала, яе разбурал', null, 2, 'Рэшткі старажытнай печы-домніцы былі знойдзеныя каля:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (83, 'гандаль ажыццяўлялася пераважна без пасрэдніцтва грошай', 'з беларускіх зямель вывозілі ў асноўным тавары рамеснай вытворчасці', 'праз беларускія землі праходзіў вялікая колькасць важных гандлёвых шляхоў', 'адсутнічалі гандлёвыя адносіны з суседнімі дзяржавамі', 'Беларускія землі ў VI-IX стст. знаходзіліся ў баку ад найбольш важных гандлёвых шляхоў, таму мясцовыя жыхары яшчэ не займаліся сапраўднай гандлем. Верагодна, што адбываўся абмен прадуктаў працы земляробаў на рамесную прадукцыю. Такім жа чынам абменьваліся', null, 2, 'Вызначыце асаблівасць развіцця гандлю на беларускіх землях у VI-IX стст.:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (84, '980 г.', '1005 г.', '1067 г.', '1127 г.', 'Полацкія князі не жадалі падпарадкоўвацца вялікаму князю кіеўскаму. У 1127 г. кіеўскі князь Мсціслаў арганізаваў паход на Полацкую зямлю. У ім прымалі ўдзел сем рускіх князёў са сваімі дружынамі. Былі занятыя Ізяслаўль і Лагойск. Небяспека навісла над Пол', null, 2, 'Паход на Полацкую зямлю сямі рускіх князёў на чале з кіеўскім князем Мсціславам адбыўся ў:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (85, 'прытча', 'міт', 'хроніка', 'летапіс', 'Прытча – невялікі рэлігійны твор павучальнага зместу. У ёй утрымліваюцца рэлігійныя або маральныя павучанні ў іншасказальна (алегарычнай) форме. Прытча блізкая да байцы, але адрозніваецца ад яе шырынёй абагульнення, значнасцю заключанай у творы ідэі. Да н', null, 2, 'Невялікі рэлігійны твор павучальнага зместу – гэта:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (86, 'вёскі Бердыж Чачэрскага раёна', 'горада Петрыкава Гомельскай вобласці', 'вёскі Лабэншчына Мінскага раёна', 'пасёлка Краснасельскі Ваўкавыскага раёна', 'Крэмень для вырабу прылад працы першабытныя "шахцёры" здабывалі 2 тыс.гадоў да н. э. у прымітыўных шахтах, падобных на студні. Шмат такіх шахтаў (глыбінёй 3-5 метраў) было адкрыта каля пасёлка Краснасельскі, недалёка ад Ваўкавыска на Гарадзеншчыне. Знойдз', null, 2, 'Старажытныя кремнездабываючыя шахты былі знойдзеныя каля:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (87, 'праз беларускія землі праходзіў вялікая колькасць важных гандлёвых шляхоў', 'асноўнай формай гандлю з''яўляліся кірмашы', 'з беларускіх зямель вывозілі ў асноўным тавары рамеснай вытворчасці', 'сродкам плацяжу з''яўлялася пушніна', 'Беларускія землі ў VI-IX стст. знаходзіліся ў баку ад найбольш важных гандлёвых шляхоў. Тут не было радовішчаў каштоўных металаў або бурштыну, пакуль яшчэ слаба было развіта рамяство. Мясцовыя жыхары яшчэ не займаліся сапраўдным гандлем. Верагодна, адбыва', null, 2, 'Вызначыце асаблівасць развіцця гандлю на беларускіх землях у VI-IX стст.:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (88, '1067 г.', '1101 г.', '1129 г.', '1157 г.', 'Полацкія князі не жадалі падпарадкоўвацца Кіеву. У 1129 г. яны адмовіліся ўдзельнічаць у сумесным паходзе на полаўцаў. У адказ на гэта кіеўскі князь Мсціслаў (сын Уладзіміра Манамаха) захапіў у палон непакорлівых полацкіх князёў разам з сем''ямі і выслаў у', null, 2, 'Кіеўскі князь Мсціслаў захапіў у палон і выслаў у Візантыю полацкіх князёў у:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (89, 'пераход да "присваивающей" гаспадаркi', 'будаўніцтва ўмацаваных паселішчаў', 'пачатак вырабу глінянага посуду', 'з''яўленне індаеўрапейцаў', 'У раннім жалезным веку, каб абараніць сябе і сваю маёмасць, людзі пачалі будаваць умацаваныя паселішчы, так званыя гарадзішчы. Гарадзішча будаваліся на ўзвышшах і ўмацоўваліся землянымі валамі, равамі, драўлянымі сценамі. Гэта рабілася з прычыны магчымага', null, 2, 'Для жалезнага веку на беларускіх землях быў (было) характэрны (-о):', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (90, 'славянамі', 'германцамі', 'татарамі', 'хазарамi', 'Славяне паступова засялялі тэрыторыю Беларусі. Яны расчышчалі зямлі для вырошчвання хлеба, адно за адным будавалі свае паселішчы. Так адбывалася каланізацыя славянамі беларускіх земляў. Але гэтая тэрыторыя яшчэ раней была засвоеная плямёнамі балтаў. Аднос', null, 2, 'У VI-VIII стст. адбывалася каланізацыя беларускіх земляў:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (91, 'грыднямi', 'тысяцкiмi', 'закупамi', 'халопамі', 'Закупы - катэгорыя залежнага сялянства. Імі станавіліся збяднелыя сяляне, якія бралі ў багатага чалавека купу (пазыку) і павінны былі працаваць у яго гаспадарцы, пакуль не аддадуць гэтую пазыку. Феадал ў дачыненні да закупаў мог выкарыстаць розныя формы п', null, 2, 'Сяляне, якія траплялі ў залежнасць, узяўшы пазыку ў багатага чалавека, называліся:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (92, 'вітражамі', 'скульптурамі', 'фрэскамі', 'гравюрамі', 'Фрэска - тэхніка манументальнага жывапісу: размалёўка вадзянымі фарбамі па свежай тынкоўцы. Высокага ўзроўню фрэскавы жывапіс дасягнуў у манументальным мастацтве X-XII стст. Хрысціянскія цэрквы звычайна ўпрыгожваліся фрэскамі і абразамі. На тэрыторыі Бела', null, 2, 'Сцены хрысціянскіх храмаў на беларускіх землях у XI-XIII стст. звычайна ўпрыгожвалі:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (93, 'пераход да "присваивающей" гаспадаркi', 'панаванне аральнага земляробства', 'пачатак вырабу глінянага посуду', 'удасканаленне вырабу каменных прылад працы', 'У бронзавым веку працягвалі выкарыстоўвацца каменныя прылады, якія былі ўдасканалены. Пры іх вырабе больш, чым раней, ужываліся шліфоўка і свідраванне. Свідраванне палегчылася пасля таго, як трубчастую костка пачалі прыводзіць у рух лучковай цецівой (прыс', null, 2, 'Для бронзавага веку на беларускіх землях быў (было) характэрны (- а):', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (94, 'татарамі', 'хазарамi', 'балтамi', 'германцамі', 'Славяне змаглі асвоіць тэрыторыю Беларусі толькі ў канцы ранняга сярэднявечча. Але гэтая тэрыторыя яшчэ раней была засвоеная плямёнамі балтаў. Адносіны балтаў і славян на тэрыторыі Беларусі першапачаткова былі мірнымі. Балцкія плямёны былі нешматлікімі, с', null, 2, 'У VI–VIII стст. на тэрыторыі Беларусі ўсходнія славяне пражывалі сумесна з:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (95, 'пагосты', 'пасады', 'дзядзінцы', 'валокі', 'Адным з галоўных шляхоў забеспячэння князя і яго дружыны ва ўсходніх славян быў збор даніны з падуладнага насельніцтва, якое падавала князю мех, воск, прадукты харчавання і г.д. збор князем даніны з насельніцтва называўся "полюдьем". "Полюдье" патрабавала', null, 2, 'Асаблівыя пункты, куды ўсходнія славяне прывозілі даніну князю, - гэта:', 1);
