INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (97, '1', '2', '3', '4', 'В 1958 г. начался выпуск первых карьерных самосвалов на Белорусском автомобильном заводе (БелАЗ) в Жодино. Сегодня «БелАЗ» входит в число ведущих мировых концернов по производству карьерной техники, выпускает от 1,5 тыс. единиц техники в год. Здесь разраб', , 1, 'Производство представленной на фотографии продукции осуществляется в городе, который обозначен на картосхеме цифрой:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (98, 'М. Мирный', 'А. Гришин', 'В. Щербо', 'С. Мартынов', 'Виталий Щербо – единственный в истории шестикратный победитель Олимпийских игр в Барселоне (1992) по спортивной гимнастике. Как обладатель шести золотых медалей, завоеванных на одной олимпиаде, занесен в Книгу рекордов  Гиннеса.  Четырехкратный  бронзовый', null, 1, 'Известный белорусский гимнаст, многократный олимпийский чемпион – это:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (99, 'на республиканский референдум 2004 г. был вынесен вопрос об установлении новых государственных флага и герба Республики Беларусь', 'конфессиональная ситуация в Беларуси на современном этапе характеризуется несформированностью в республике религиозного законодательства', 'самой массовой общественной организацией трудящихся в Беларуси является Федерация профсоюзов Беларуси', 'политические партии оказывают значительное влияние на общественно-политическую жизнь в Республике Беларусь', 'Граждане Республики Беларусь на добровольной основе для защиты своих трудовых прав и интересов объединяются в профессиональные союзы, которые участвуют в разработке и реализации социально-экономической политики государства. Общее количество членов Федерац', null, 1, 'Определите правильное утверждение:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (100, 'отказ от сотрудничества с бывшими республиками СССР', 'принятие Конституции Республики Беларусь', 'сохранение однопартийной политической системы', 'смена административно- территориального устройства', 'Важное значение для закрепления суверенитета республики имело принятие Верховным Советом 15 марта 1994 г. Конституции Республики Беларусь. Это основной закон государства. Конституция определяет и закрепляет общественный и государственный строй, правовое п', null, 1, 'Важное значение для закрепления суверенитета Республики Беларусь имел(-о; -а):', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (101, 'постановлением Верховного Совета Республики Беларусь', 'путем проведения республиканского референдума', 'Указом Президента Республики Беларусь', 'постановлением Всебелорусского народного собрания', 'Важную роль в процессе становления и закрепления государственного  суверенитета сыграл республиканский референдум, проведенный по инициативе Президента Республики Беларусь 14 мая 1995 г. Президент получил поддержку граждан по всем вопросам, вынесенным на ', null, 1, 'Решение о придании русскому языку статуса, равного с белорусским, было принято:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (102, 'валовой внутренний продукт', 'государственный бюджет', 'национальный доход', 'человеческий капитал', 'Беларусь во время распада СССР и образования СНГ была одной из самых индустриально развитых республик. Она лидировала среди стран СНГ по показателям дохода на душу населения. Кризис в белорусской экономике начался позже, чем в других республиках СССР. Тол', null, 1, 'Стоимость изготовленного на территории страны на протяжении года конечного продукта (продукции, товаров, услуг) – это:', 1);
