INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (104, 'постановлением Верховного Совета Республики Беларусь', 'путем проведения республиканского референдума', 'Указом Президента Республики Беларусь', 'постановлением Всебелорусского народного собрания', 'В 1996 г. в Республике Беларусь состоялся республиканский референдум, одним из вопросов которого было вынесенное Президентом Республики Беларусь А. Г. Лукашенко предложение о переносе Дня Независимости Республики Беларусь (Дня Республики) с 27 на 3 июля –', null, 1, 'Решение о переносе Дня Независимости Республики Беларусь (Дня Республики) с 27 на 3 июля было принято:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (105, 'инфляция', 'девальвация', 'инвестиция', 'стагнация', 'Официальное уменьшение золотого содержания денежной единицы или снижение курса национальной валюты в отношении к иностранной валюте – это девальвация. В Республике Беларусь девальвация белорусского рубля была вызвана последствиями мирового финансово-эконо', null, 1, 'Официальное уменьшение золотого содержания денежной единицы или снижение курса национальной валюты в отношении к иностранной валюте – это:', 2);
