INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (109, 'адмова ад супрацоўніцтва з былымі рэспублікамі СССР', 'прыняцце Канстытуцыі Рэспублікі Беларусь', 'сохранение однопартийной политической системы', 'змена адміністрацыйна-тэрытарыяльнага прылады', 'Важнае значэнне для замацавання суверэнітэта рэспублікі мела прыняцце Вярхоўным Саветам 15 сакавіка 1994 г. Канстытуцыі Рэспублікі Беларусь. Гэта асноўны закон дзяржавы. Канстытуцыя вызначае і замацоўвае грамадскі і дзяржаўны лад, прававое становішча асоб', null, 2, 'Важнае значэнне для замацавання суверэнітэта Рэспублікі Беларусь меў(-а):', 2);
