INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (111, 'валавы ўнутраны прадукт', 'дзяржаўны бюджэт', 'нацыянальны даход', 'чалавечы капітал', 'Беларусь падчас распаду СССР і стварэння СНД была адной з самых індустрыяльна развітых рэспублік. Яна лідзіравала сярод краін СНД па паказчыках даходу на душу насельніцтва. Крызіс у беларускай эканоміцы пачаўся пазней, чым у іншых рэспубліках СССР. Толькі', null, 2, 'Кошт вырабленага на тэрыторыі краіны на працягу года канчатковага прадукту (прадукцыі, тавараў, паслуг) - гэта:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (112, 'правядзенне рэспубліканскіх рэферэндумаў па найважнейшых пытаннях', 'адмова ад удзелу ў працы міжнародных арганізацый', 'поўны адмову ад савецкага палітычнага вопыту', 'сохранение однопартийной политической системы', 'Важную ролю ў працэсе станаўлення і замацавання дзяржаўнага суверэнітэту Рэспублікі Беларусь адыгралі рэспубліканскія рэферэндумы. Рэферэндум – усенароднае галасаванне па важнейшых пытаннях жыццядзейнасці краіны, адзін з асноўных інстытутаў непасрэднай дэ', null, 2, 'Важнае значэнне для замацавання суверэнітэта Рэспублікі Беларусь меў(-а):', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (113, 'пастановай Вярхоўнага Савета Рэспублікі Беларусь', 'шляхам правядзення рэспубліканскага рэферэндуму', 'Указам Прэзідэнта Рэспублікі Беларусь', 'пастановай Усебеларускага народнага сходу', 'У 1996 г. у Рэспубліцы Беларусь адбыўся рэспубліканскі рэферэндум, адным з пытанняў якога была вынесеная Прэзідэнтам Рэспублікі Беларусь А. Р. Лукашэнкам прапанова аб пераносе Дня Незалежнасці Рэспублікі Беларусь (Дня Рэспублікі) з 27 на 3 ліпеня – дзень ', null, 2, 'Рашэнне аб пераносе Дня Незалежнасці Рэспублікі Беларусь (Дня Рэспублікі) з 27 на 3 ліпеня было прынята:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (114, 'інфляцыя', 'дэвальвацыя', 'інвестыцыя', 'стагнацыя', 'Афіцыйнае змяншэнне залатога ўтрымання грашовай адзінкі або зніжэнне курсу нацыянальнай валюты ў адносінах да замежнай валюты – гэта дэвальвацыя. У Рэспубліцы Беларусь дэвальвацыя беларускага рубля была выклікана наступствамі сусветнага фінансава-эканаміч', null, 2, 'Афіцыйнае змяншэнне залатога ўтрымання грашовай адзінкі або зніжэнне курсу нацыянальнай валюты ў адносінах да замежнай валюты – гэта:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (115, 'отсутствие внешней угрозы со стороны крестоносцев', 'ослабление Галицко-Волынского княжества', 'принятие католичества в качестве государственной религии', 'заключение унии с Польским королевством', 'После смерти Витеня великокняжеский престол занял его брат Гедимин. Во времена его правления (1316–1341) Великое Княжество Литовское стало одним из главных центров объединения восточнославянских земель. Этому способствовало то, что Галицко-Волынское княже', null, 1, 'Определите фактор, который содействовал превращению Великого Княжества Литовского (ВКЛ) в один из главных центров объдинения восточнославянских земель в первой половине XIV в.:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (116, 'Кревская', 'Виленско-Радомская', 'Городельская', 'Брестская', 'Поражение Витовта на Ворскле поставило его в непростое политическое положение и вынудило заключить в 1401 г. Виленско-Радомскую унию с Польшей. Витовт официально приобрел титул великого князя литовского. Он стал пожизненным правителем ВКЛ и получил полную', null, 1, 'В 1401 г. между руководством ВКЛ и Польши была заключена уния:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (117, '1', '2', '3', '4', 'Большую угрозу южным землям ВКЛ представляли крымские татары. Крымское ханство обособилось от Золотой Орды в середине ХV в. и сначала находилось в добрососедских отношениях с ВКЛ. Однако с конца XV в. сближение ВКЛ с Золотой Ордой, с целью ослабления Моск', null, 1, 'Битва, в которой в августе 1506 г. князь М. Глинский разгромил крымских татар, состоялась в месте, обозначенном на картосхеме цифрой:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (118, 'право суда феодалов над зависимым населением', 'наказание за помощь при побеге зависимых крестьян от феодалов', 'десятилетний срок давности для закрепощения крестьян', 'фольварочно-барщинная система', 'Основным принципом при закрепощении феодалами крестьян была «давность», это значит продолжительность их проживания на одном месте. Использование этого принципа началось уже в середине ХV в. В Статуте ВКЛ 1529 г. вводился десятилетний  срок давности. С это', null, 1, 'Согласно статьям Статута ВКЛ 1529 г. впервые вводилось(-ся, -ась):', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (119, 'готический', 'барокко', 'романский', 'класіцызм', 'Постоянная военная угроза наложила отпечаток на культовое зодчество. В ХІV–ХV вв. белорусских землях распространяется готический стиль, для которого характерны сдержанность, суровость, а также использование кирпича, а не камня. Главной особенностью архите', null, 1, 'Определите художественный стиль, который господствовал в архитектуре в XIV–XV вв. на белорусских землях:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (120, 'Кревская', 'Виленско-Радомская', 'Городельская', 'Брестская', 'Укрепление в ВКЛ в начале XV в. позиций Витовта вновь поставило вопрос об отношениях с Польшей. Ягайло был вынужден начать переговоры о возобновлении унии. В 1413 г. состоялся съезд феодалов Польши и ВКЛ в замке Городло (на Западном Буге), на котором была', null, 1, 'В 1413 г. между руководством ВКЛ и Польши была заключена уния:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (121, '1', '2', '3', '4', 'Наибольшего напряжения противостояние между ВКЛ и Московским государством достигло в войне 1512–1522 гг. В 1514 г. войско московского князя Василия III штурмом овладело Смоленском и двинулось вглубь ВКЛ. Появился даже проект раздела ВКЛ и Польши между Мос', , 1, 'Город, возле которого в 1514 г. войско ВКЛ под командованием К. Острожского нанесло крупное поражение войску Московского государства, обозначен на картосхеме цифрой:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (122, 'право собственности феодалов на землю', 'наказание за помощь при побеге зависимых от феодалов людей', 'десятилетний срок давности для закрепощения крестьян', 'фольварочно-барщинная система', 'В 1468 г. увидел свет первый сборник законов Великого Княжества Литовского, который получил название Судебник. Он устанавливал единые во всем княжестве три вида наказаний: денежный штраф, телесные наказания, смертная казнь. Судебник содействовал дальнейше', null, 1, 'Согласно статьям Судебника 1468 г. впервые вводилось(-ся, -ась):', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (123, 'атеизма', 'романтизма', 'гуманизма', 'аскетизма', 'В начале XVI в. на белорусских землях начинают распространяться идеи Возрождения, или Ренессанса. Это было время подъема науки и искусства, расширения в обществе гуманизма. Ренессанс проявился в повышении внимания к человеку, его внешней и внутренней крас', null, 1, 'На развитие белорусской культуры в первой половине XVI в. начинают оказывать влияние идеи:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (124, 'в XII–XIII вв. у балтов существовали самостоятельные государства', 'ядром образования Великого Княжества Литовского (ВКЛ) стало Верхнее и Среднее Поднепровье', 'князь Миндовг принял католичество и в 1253 г. короновался в Вильне', 'процесс образования ВКЛ был ускорен внешней угрозой', 'В середине ХІІІ в. над белорусскими землями нависла страшная угроза. В результате монголо-татарского нашествия большинство земель Руси было захвачено. Была целиком нарушена система политических отношений, существовавшая ранее. Для сохранения независимости', null, 1, 'Определите правильное утверждение:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (125, 'закрепления государственной унии между ВКЛ и Польшей', 'ограничения абсолютной монархии в государстве', 'унификации государственного законодательства', 'ослабления феодального гнета', 'Развитие феодального общества ВКЛ привело к тому, что в начале ХVІ в. возникла необходимость в более совершенном законодательстве. С этой целью в 1529 г. все изданные ранее великими князьями привилеи, законы, собранные в Судебнике 1468 г., государственные', null, 1, 'Статут ВКЛ 1529 г. был создан с целью:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (126, '1500–1503 гг.', '1507–1508 гг.', '1512–1522 гг.', '1534–1537 гг.', 'Наибольшего напряжения противостояние между ВКЛ и Московским государством достигло в войне 1512–1522 гг. В 1514 г. после нескольких безуспешных попыток войско московского князя Василия ІІІ   штурмом   овладело   Смоленском. Это был самый опасный момент дл', null, 1, 'ВКЛ потеряло Смоленскую землю в результате войны с Московским княжеством в', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (127, 'ослабление феодальной эксплуатации', 'создание мануфактурного производства', 'сокращение объемов внешней торговли', 'широкое распространение барщины', 'Барщина – бесплатный принудительный труд крестьян с использованием собственных орудий труда в хозяйстве феодала. Барщина известна на белорусских землях с ХІV в., однако широко стала распространяться с середины ХV – ХVІ в., когда сложилась фольварочная сис', null, 1, 'Для экономического развития белорусских земель в XVI в. было характерно:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (128, 'активная деятельность католических монашеских орденов', 'сокращение церковного землевладения', 'значительная поддержка православной церкви со стороны верховной власти', 'массовое распространение униатства', 'Сначала католические монашеские ордены начали действовать на территории Польши, а затем проникли на белорусские и литовские земли. В ХV в. активную деятельность развернули здесь представители орденов францисканцев, доминиканцев, августинцев и др. Всего к ', null, 1, 'Определите характерную черту конфессионального положения ВКЛ в XV – первой половине XVI в.:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (129, 'князь Миндовг принял православие и в 1253 г. короновался в Вильне', 'ядром создания Великого Княжества Литовского (ВКЛ) стало Верхнее и Среднее Понеманье', 'сильным соперником князя Миндовга в борьбе за Новогрудскую землю являлось Московское княжество', 'объединению балтов и славян в одно государство в ХIII в. способствовало отсутствие внешней угрозы', 'В середине ХІІІ в. князь Миндовг распространил свою власть не только на всю Литву, но и на Белорусское Понеманье с городами Новогрудок, Волковыск и Слоним. Это фактически стало началом образования Великого Княжества Литовского (ВКЛ). Миндовг принял католи', null, 1, 'Определите правильное утверждение:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (130, 'Л. Сапеги', 'О. Воловича', 'Н. Радзивилла', 'А. Гаштольда', 'Альбрехт Гаштольд – канцлер ВКЛ, крупнейший магнат. Выступал против унии с Польшей. Участвовал в битвах с татарами под Давыд- Городком (1503) и Новогрудком (1505), в войне с Московским государством (1507–1508). Под руководством А. Гаштольда был подготовле', null, 1, 'Статут ВКЛ 1529 г. был подготовлен под руководством канцлера ВКЛ:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (131, '1500–1503 гг.', '1507–1508 гг.', '1512–1522 гг.', '1534–1537 гг.', 'Противоречия между ВКЛ и Московским государством в конце XIV – начале XV в. вылились в очередную войну. Военные действия происходили не в пользу ВКЛ, войско которого в июле 1500 г. потерпело поражение на р. Ведроша. ВКЛ надеялось найти поддержку у Золотой', null, 1, 'ВКЛ утратило города Новгород- Северский, Чернигов, Брянск, Стародуб, Гомель и другие в результате войны с Московским княжеством в:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (132, 'отсутствие цехового ремесла', 'активное закрепощение крестьян', 'ослабление торговых связей между городом и деревней', 'расширение крестьянского землевладения', 'Главным богатством в средние века являлась земля. На протяжении XIV–XV вв. в ВКЛ почти полностью завершился ее переход в руки феодалов. Феодалам, получившим в собственность большие земельные владения, требовались крестьяне, которые бы обрабатывали землю. ', null, 1, 'Для экономического развития белорусских земель в XVI в. было характерно:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (133, 'активное распространение униатства', 'значительное увеличение количества православных храмов', 'массовое преследование нехристианского населения', 'установление относительной религиозной толерантности', 'В первой половине ХVІ в. произошли изменения в религиозном положении в ВКЛ. Представители православной знати все чаще допускались к высшим государственным должностям, что нарушало условия  Городельского  привилея  1413 г. Это должно было задобрить правосл', null, 1, 'Определите характерную черту конфессионального положения ВКЛ в XV – первой половине XVI в.:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (134, 'адсутнасць знешняй пагрозы з боку крыжакоў', 'аслабленне Галіцка-Валынскага княства', 'прыняцце каталіцтва ў якасці дзяржаўнай рэлігіі', 'заключэнне уніі з Польскім каралеўствам', 'Пасля смерці Віценя велікакняжацкі прастол заняў яго брат Гедымін. Пад час яго ўлады (1316-1341) Вялікае Княства Літоўскае стала адным з галоўных цэнтраў аб''яднання ўсходнеславянскіх зямель. Гэтаму спрыяла тое, што Галіцка-Валынскае княства аслабла і пача', null, 2, 'Вызначце фактар, які садзейнічаў ператварэнню Вялікага Княства Літоўскага (ВКЛ) у адзін з галоўных цэнтраў аб''яднання ўсходнеславянскіх земляў у першай палове XIV ст.:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (135, 'Крэўская', 'Віленска-Радамская', 'Гарадзельская', 'Брэсцкая', 'Паражэнне Вітаўта на Ворскле паставіла яго ў няпростае палітычнае становішча і прымусіла заключыць у 1401 г. віленскі-Радамскую унію з Польшчай. Вітаўт афіцыйна набыў тытул вялікага князя літоўскага. Ён стаў пажыццёвым кіраўніком ВКЛ і атрымаў поўную сваб', null, 2, 'У 1401 г. паміж кіраўніцтвам ВКЛ і Польшчы была заключана Унія:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (136, '1', '2', '3', '4', 'Вялікую пагрозу паўднёвым землям ВКЛ прадстаўлялі крымскія татары. Крымскае ханства адасобілася ад Залатой Арды ў сярэдзіне ХV ст. і спачатку знаходзілася ў добрасуседскіх адносінах з ВКЛ. Аднак з канца XV ​​ст. збліжэнне ВКЛ з Залатой Ардой, з мэтай пасл', , 2, 'Бітва, у якой у жніўні 1506 г. князь М. Глінскі разграміў крымскіх татараў, адбылася ў месцы, пазначаным на картосхеме лічбай:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (137, 'права суда феадалаў над залежным насельніцтвам', 'пакаранне за дапамогу пры ўцёках залежных сялян ад феадалаў', 'дзесяцігадовы тэрмін даўнасці для занявольванні сялян', 'фальварка-баршчынная сістэма', 'Асноўным прынцыпам пры запрыгоньваннi феадаламі сялян была «даўнасць», гэта значыць працягласць іх пражывання на адным месцы. Выкарыстанне гэтага прынцыпу пачалося ўжо ў сярэдзіне ХV ст. У Статуце ВКЛ 1529 г. уводзіўся дзесяцігадовы тэрмін даўніны. З гэта', null, 2, 'Паводле артыкулаў Статута ВКЛ 1529 г. упершыню ўводзілася:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (138, 'гатычны', 'барока', 'раманскі', 'классицизм', 'Пастаянная ваенная пагроза наклала адбітак на культавае дойлідства. У ХІV-ХV стст. беларускіх землях распаўсюджваецца гатычны стыль, для якога характэрныя стрыманасць, суровасць, а таксама выкарыстанне цэглы, а не каменя. Галоўнай асаблівасцю архітэктуры ', null, 2, 'Вызначце мастацкі стыль, які панаваў у архітэктуры ў XIV-XV стст. на беларускіх землях:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (139, 'Крэўская', 'Віленска-Радамская', 'Гарадзельская', 'Брэсцкая', 'Умацаванне ў ВКЛ у пачатку XV ст. пазіцый Вітаўта зноў паставіла пытанне аб адносінах з Польшчай. Ягайла быў вымушаны пачаць перагаворы пра аднаўленне уніі. У 1413 г. адбыўся з''езд феадалаў Польшчы і ВКЛ у замку Гарадло (на Заходнім Бугу), на якім была па', null, 2, 'У 1413 г. паміж кіраўніцтвам ВКЛ і Польшчы была заключана Унія:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (140, '1', '2', '3', '4', 'Найбольшага напружання супрацьстаянне паміж ВКЛ і Маскоўскай дзяржавай дасягнула ў вайне 1512-1522 гг. У 1514 г. войска Маскоўскага князя Васіля III штурмам авалодала Смаленскам і рушыла ўглыб ВКЛ. З''явіўся нават праект падзелу ВКЛ і Польшчы паміж Маскоўс', , 2, 'Горад, каля якога ў 1514 г. войска ВКЛ пад камандаваннем К. Астрожскага нанесла буйную паразу войску Маскоўскай дзяржавы, пазначаны на картасхеме лічбай:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (141, 'права ўласнасці феадалаў на зямлю', 'пакаранне за дапамогу пры ўцёках залежных ад феадалаў людзей', 'дзесяцігадовы тэрмін даўнасці для занявольванні сялян', 'фальварка-баршчынная сістэма', 'У 1468 г. пабачыў свет першы зборнік законаў Вялікага Княства Літоўскага, які атрымаў назву Судзебнік. Ён устанаўліваў адзіныя ва ўсім княстве віды пакаранняў: грашовы штраф, цялесныя пакарання, смяротнае пакаранне. Судзебнік садзейнічаў далейшаму прыгону', null, 2, 'Паводле артыкулаў Судзебніка 1468 г. упершыню ўводзілася:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (142, 'атэізму', 'рамантызму', 'гуманізму', 'аскетызму', 'У пачатку XVI ст. на беларускіх землях пачынаюць распаўсюджвацца ідэі адраджэння, або рэнесансу. Гэта быў час уздыму навукі і мастацтва, пашырэння ў грамадстве гуманізму. Рэнесанс выявіўся ў павышэнні ўвагі да чалавека, яго знешняй і ўнутранай прыгажосці,', null, 2, 'На развіццё беларускай культуры ў першай палове XVI ст. пачынаюць аказваць уплыў ідэі:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (143, 'у XII-XIII стст. у балтаў існавалі самастойныя дзяржавы', 'цэнтрам ўтварэння Вялікага Княства Літоўскага (ВКЛ) стала Верхняе і Сярэдняе Падняпроўе', 'князь Міндоўг прыняў каталіцтва і ў 1253 г. каранаваўся ў Вільне', 'працэс утварэння ВКЛ быў паскораны знешняй пагрозай', 'У сярэдзіне ХІІІ ст. над беларускімі землямі навісла страшная пагроза. У выніку мангола-татарскага нашэсця большасць зямель Русі было захоплена. Была цалкам парушана сістэма палітычных адносін, якая існавала раней. Для захавання незалежнасці беларускія зе', null, 2, 'Вызначыце правільнае сцвярджэнне:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (144, 'замацавання дзяржаўнай уніі паміж ВКЛ і Польшчай', 'абмежаванні абсалютнай манархіі ў дзяржаве', 'уніфікацыі дзяржаўнага заканадаўства', 'паслаблення феадальнага прыгнёту', 'Развіццё феадальнага грамадства ВКЛ прывяло да таго, што ў пачатку ХVІ ст. паўстала неабходнасць у больш дасканалым заканадаўстве. З гэтай мэтай ў 1529 г. усе выдадзеныя раней вялікімі князямі прывілеі, законы, сабраныя ў Судзебніку 1468 г., дзяржаўныя па', null, 2, 'Статут ВКЛ 1529 г. быў утвораны з мэтай:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (145, '1500–1503 гг.', '1507–1508 гг.', '1512–1522 гг.', '1534–1537 гг.', 'Найбольшага напружання супрацьстаянне паміж ВКЛ і Маскоўскай дзяржавай дасягнула ў вайне 1512-1522 гг. У 1514 г. пасля некалькіх беспаспяховых спробаў войска маскоўскага князя Васіля ІІІ штурмам авалодала Смаленскам. Гэта быў самы небяспечны момант для ВК', null, 2, 'ВКЛ страціла Смаленскую зямлю ў выніку вайны з Маскоўскім княствам у:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (146, 'аслабленне феадальнай эксплуатацыі', 'стварэнне мануфактурнай вытворчасці', 'скарачэнне аб''ёмаў знешняга гандлю', 'шырокае распаўсюджванне паншчыны', 'Паншчына - бясплатная прымусовая праца сялян з выкарыстаннем уласных прылад працы ў гаспадарцы феадала. Паншчына вядома на беларускіх землях з ХІV ст., аднак шырока стала распаўсюджвацца з сярэдзіны ХV - ХVІ ст., калі склалася фольварачная сістэма, якая п', null, 2, 'Для эканамічнага развіцця беларускіх зямель у XVI ст. было характэрна:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (147, 'актыўная дзейнасць каталіцкіх манаскіх ордэнаў', 'скарачэнне царкоўнага землеўладання', 'значная падтрымка праваслаўнай царквы з боку вярхоўнай улады', 'масавае распаўсюджванне уніяцтва', 'Спачатку каталіцкія манаскія ордэны пачалі дзейнічаць на тэрыторыі Польшчы, а затым праніклі на беларускія і літоўскія землі.  У ХV ст. актыўную дзейнасць разгарнулі тут прадстаўнікі ордэнаў францысканцаў, дамініканаў, аўгустынцаў і інш. Усяго да сярэдзін', null, 2, 'Вызначце характэрную рысу канфесійнага становішча ВКЛ у XV-першай палове XVI ст.:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (148, 'князь Міндоўг прыняў праваслаўе і ў 1253 г. каранаваўся ў Вільні', 'ядром стварэння Вялікага Княства Літоўскага (ВКЛ) стала верхняе і сярэдняе Панямонне', 'моцным супернікам князя Міндоўга ў барацьбе за Навагрудскую зямлю з''яўлялася Маскоўскае княства', 'аб''яднанню балтаў і славян у адну дзяржаву ў ХІІІ ст. спрыяла адсутнасць знешняй пагрозы', 'У сярэдзіне ХІІІ ст. князь Міндоўг распаўсюдзіў сваю ўладу не толькі на ўсю Літву, але і на Беларускае Панямонне з гарадамі Навагрудак, Ваўкавыск і Слонім. Гэта фактычна стала пачаткам утварэння Вялікага Княства Літоўскага (ВКЛ). Міндоўг прыняў каталіцтва', null, 2, 'Вызначце правільнае сцвярджэнне:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (149, 'Л. Сапегі', 'А. Валовіча', 'Н. Радзівіла', 'А. Гаштольда', 'Альбрэхт Гаштольд-канцлер ВКЛ, найбуйнейшы магнат. Выступаў супраць уніі з Польшчай. Удзельнічаў у бітвах з татарамі пад Давыд-Гарадком (1503) і Навагрудкам (1505), у вайне з Маскоўскай дзяржавай (1507-1508). Пад кіраўніцтвам А. Гаштольда быў падрыхтаваны', null, 2, 'Статут ВКЛ 1529 г. быў падрыхтаваны пад кіраўніцтвам канцлера ВКЛ:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (150, '1500–1503 гг.', '1507–1508 гг.', '1512–1522 гг.', '1534–1537 гг.', 'Супярэчнасці паміж ВКЛ і Маскоўскай дзяржавай у канцы XIV-пачатку XV ст. выліліся ў чарговую вайну. Ваенныя дзеянні адбываліся не на карысць ВКЛ, войска якога ў ліпені 1500 г. пацярпела паразу на р. Ведроша. ВКЛ спадзявалася знайсці падтрымку ў Залатой Ар', null, 2, 'ВКЛ страціла горада Ноўгарад-Северскі, Чарнігаў, Бранск, Старадуб, Гомель і іншыя ў выніку вайны з Маскоўскім княствам у:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (151, 'адсутнасць цэхавага рамёствы', 'актыўнае запрыгоньванне сялян', 'паслабленне гандлёвых сувязей паміж горадам і вёскай', 'пашырэнне сялянскага землеўладання', 'Галоўным багаццем у сярэднія вякі з''яўлялася зямля. На працягу XIV-XV стст. у ВКЛ амаль цалкам завяршыўся яе пераход у рукі феадалаў. Феадалам, якія атрымалі ва ўласнасць вялікія зямельныя ўладанні, патрабаваліся сяляне, якія б апрацоўвалі зямлю. Для гэта', null, 2, 'Для эканамічнага развіцця беларускіх зямель у XVI ст. было характэрна:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (152, 'актыўнае распаўсюджванне уніяцтва', 'значнае павелічэнне колькасці праваслаўных храмаў', 'масавы пераслед нехрысціянскага насельніцтва', 'усталяванне адноснай рэлігійнай талерантнасці', 'У першай палове ХVІ ст. адбыліся змены ў рэлігійным становішчы ў ВКЛ. Прадстаўнікі праваслаўнай шляхты ўсё часцей дапускаліся да вышэйшых дзяржаўных пасадам, што парушала ўмовы Гарадзельскага прывілею 1413 г. Гэта павінна было задобрыць праваслаўнае насел', null, 2, 'Вызначце характэрную рысу канфесійнага становішча ВКЛ у XV-першай палове XVI ст.:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (153, 'Россия получила выход к Балтийскому морю', 'ВКЛ утратило значительную часть западных территорий', 'Россия получила выход к Черному морю', 'ВКЛ вынуждено было пойти на унию с Польшей', 'Ливонская война выявила недостаточность внутреннего  потенциала в ВКЛ для достижения успеха в военных действиях. Политическая элита ВКЛ осознавала необходимость внешней поддержки со стороны Польши для эффективной борьбы с Московским государством. Однако п', null, 1, 'Определите последствие Ливонской войны 1558–1583 гг.:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (154, 'присвоение или отмена шляхетских званий', 'введение новых налогов', 'рассмотрение апелляционных дел', 'контроль за исполнением функций и обязанностей монархом', 'В 1581 г. был создан Трибунал ВКЛ – высшее судебное учреждение страны. Это был шляхетский суд, который формировался из представителей поветовой шляхты. Трибунал ВКЛ рассматривал апелляционные дела. К ним относились   обжалование приговоров местных судов, ', null, 1, 'Определите одну из функций Трибунала ВКЛ:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (155, 'францисканцев', 'иезуитов', 'пиаров', 'доминиканцев', 'С распространением реформационных идей католическая  церковь начала с ними активную борьбу. В 1569 г. виленский епископ В. Протасевич пригласил в ВКЛ 13 представителей   ордена иезуитов  (члены католического монашеского ордена Общества Иисуса, созданного ', null, 1, 'Для борьбы с реформационным движением виленский епископ В. Протасевич в 1569 г. пригласил в ВКЛ орден:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (156, 'Уречье', 'Слуцке', 'Вишнево', 'Налибоках', 'В ХVІІІ в. к наиболее известным предприятиям принадлежала Слуцкая мануфактура шелковых поясов, которую называли персиарней. Эту мануфактуру М. К. Радзивилл открыл в начале 1760-х гг. Там изготавливали знаменитые слуцкие пояса, ковры, «персидскую», «китайс', , 1, 'Представленная на фотографии продукция была изготовлена в XVIII в. на мануфактуре в:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (157, 'вооруженные конфликты между магнатскими группировками', 'введение ограничений на использование права «либерум вето»', 'установление в государстве абсолютной монархии', 'расширение прав низших сословий', 'Во второй половине XVII в. общегосударственный сейм постепенно терял свое значение. Используя право «либерум вето», шляхетские послы срывали его заседания. В управлении внутренними делами Речи Посполитой возросло значение поветовых шляхетских сеймиков. Ст', null, 1, 'Свидетельством политического кризиса в Речи Посполитой в конце XVII в. являлись(-ось):', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (158, 'перевод обучения на белорусский язык', 'усиление контроля церкви над образованием', 'закрепление принципа сословности в образовании', 'придание образованию светского характера', 'Вторая половина ХVІІІ в. характеризуется постепенным  выходом общественной мысли и образования из-под влияния  церкви. В 1773 г. приказом римского папы была запрещена деятельность иезуитов. Имущество ордена перешло к Эдукационной комиссии, которая считала', null, 1, 'Определите один из итогов реформы образования 1770–1790-х гг. в Речи Посполитой:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (159, 'сбор посполитого рушения', 'рассмотрение жалоб на злоупотребления должностных лиц', 'контроль за сохранением шляхетских вольностей', 'введение новых налогов', 'Созданный в 1581 г. Трибунал Великого Княжества Литовского являлся высшим судебным учреждением страны. Это был шляхетский суд, который формировался из представителей поветовой шляхты. Судьями могли стать только уроженцы ВКЛ, срок их деятельности ограничив', null, 1, 'Определите одну из функций Трибунала ВКЛ:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (160, 'францисканцев', 'иезуитов', 'базилиан', 'доминиканцев', 'Орден базилиан (Святого Василия Великого) был создан по инициативе униатского митрополита И. Руцкого (Рутского) при поддержке И. Кунцевича из православных монахов, принявших унию. В 1617 г. был принят устав базилиан, разработанный на основе правил святого', null, 1, 'В первой трети XVII в. униатской церковью на землях Речи Посполитой был создан монашеский орден:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (161, 'Уречье', 'Слуцке', 'Вишнево', 'Налибоках', 'Уречская мануфактура была основана в 1737 г. во владениях А. Радзивилл и сначала называлась зеркальной. Это было первое предприятие по изготовлению зеркал в Речи Посполитой. Здесь изготавливали оконное стекло, хрустальные люстры, подсвечники, зеркала, пос', , 1, 'Представленная на фотографии продукция была изготовлена в XVIII в. на мануфактуре в:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (162, 'установление в государстве абсолютной монархии', 'ослабление иностранного влияния на внутренние дела государства', 'ликвидация магдебургского права в городах и местечках', 'деятельность многочисленных шляхетских конфедераций', 'Во второй половине XVII в. общегосударственный сейм постепенно терял свое значение. Используя право «либерум вето», шляхетские послы срывали его заседания. В управлении внутренними делами Речи Посполитой возросло значение поветовых шляхетских сеймиков. Ст', null, 1, 'Свидетельством политического кризиса в Речи Посполитой в XVIII в. являлись(-ось):', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (163, 'перевод обучения на латинский язык', 'усиление контроля церкви над образованием', 'преобладание в обучении естественных и общественных наук', 'введение обязательного начального образования', 'В 1773 г. была создана Эдукационная комиссия, которая считается первым в Европе светским учреждением в сфере просвещения. В ее распоряжение были переданы учебные заведения, которые раньше принадлежали иезуитам. Школьное образование приобрело нецерковный и', null, 1, 'Определите один из итогов реформы образования 1770–1790-х гг. в Речи Посполитой:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (164, 'Государственная дума', 'Посольская Изба', 'Сенат', 'Наивысшая литовская рада', 'Высшим органом государственной власти в Речи Посполитой являлся общегосударственный вальный сейм. Он состоял из Сената и Посольской Избы. Посольская Изба формировалась из представителей  шляхетского   сословия   страны.  В каждом повете шляхта выбирала в ', null, 1, 'Нижняя палата сейма Речи Посполитой, которая формировалась из представителей шляхетского сословия страны, – это:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (165, 'ликвидация крепостного права', 'появление мануфактурного производства', 'расширение товарообмена между городом и деревней', 'отсутствие социальных противоречий между крестьянами и феодалами', 'Во второй половине XVI – первой половине XVII в. сельское хозяйство белорусско-литовских земель переживало подъем. Он был вызван расширением обмена товарами между городом и деревней, увеличением количества городского населения, ростом спроса на зерно как ', null, 1, 'Определите одну из причин подъема в развитии хозяйства ВКЛ во второй половине XVI – первой половине XVII в.:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (166, 'К. Острожский', 'Н. Радзивилл Черный', 'А. Гаштольд', 'А. Тизенгауз', 'Николай Радзивилл Черный – виленский воевода и канцлер ВКЛ, меценат. Возглавил комиссию по проведению  аграрной  реформы.  Был противником государственной унии с Польшей. Отстаивал самостоятельность ВКЛ. Первоначально присоединился к лютеранству, а затем ', null, 1, 'Государственный деятель ВКЛ, представитель известного магнатского рода, лидер кальвинизма в ВКЛ – это:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (167, 'неиспользовании права «либерум вето» при рассмотрении экономических вопросов', 'уравнении прав диссидентской шляхты с католической', 'введении польского языка в делопроизводство ВКЛ', 'проведении каждого третьего сейма Речи Посполитой в Гродно', 'На сейме в 1764 г. в Речи Посполитой было принято решение не использовать право «либерум вето» при рассмотрении экономических вопросов. Теперь для введения новых налогов или создания контролирующих органов власти требовалось одобрение шляхетских послов бо', null, 1, 'Сейм Речи Посполитой 1764 г. принял решение о (об):', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (168, 'провозглашение независимости ВКЛ', 'установление в стране демократической республики', 'возвращение Речи Посполитой отнятых земель', 'передача крестьянам помещичьей земли в собственность', 'Восстание 1794 г. началось с провозглашения Т. Костюшко «Акта восстания» в Кракове. Документ определил цель выступления – восстановление Речи Посполитой  в  границах  1772 г. Реализация «Акта восстания» требовала вывода иностранных войск, возвращения отоб', null, 1, 'Определите одно из требований участников восстания 1794 г.:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (169, 'Ф. Скорина', 'М. Гусовский', 'С. Будный', 'С. Полоцкий', 'С. Полоцкий в 1664 г. переселился в Москву. В российской столице поэт основал «латинскую» школу при Заиконоспасском монастыре, типографию. С. Полоцкий свои произведения писал на старобелорусском, польском и латинском языках. До потомков дошли два больших ', , 1, 'Определите автора книги, титульный лист которой представлен на иллюстрации:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (170, 'Государственная дума', 'Посольская Изба', 'Сенат', 'Наивысшая литовская рада', 'Высшим органом государственной власти в Речи Посполитой являлся общегосударственный вальный сейм. На нем представители шляхты объявляли войну, заключали мирные соглашения с другими странами, давали согласие на сбор посполитого рушения, введения военного н', null, 1, 'Высшая палата сейма Речи Посполитой, в которую входили представители высшего католического духовенства, высшие должностные лица государства, – это:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (171, 'рост спроса на зерно на внутреннем рынке и в Западной Европе', 'появление мануфактурного производства', 'отсутствие социальных противоречий между крестьянами и феодалами', 'ослабление феодального гнета', 'Во второй половине XVI – первой половине XVII в. сельское хозяйство белорусско-литовских земель переживало подъем. Он был вызван расширением обмена товарами между городом и деревней, увеличением количества городского населения, ростом спроса на зерно как ', null, 1, 'Определите одну из причин подъема в развитии хозяйства ВКЛ во второй половине XVI – первой половине XVII в.:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (172, 'Сигизмунд I Старый', 'Стефан Баторий', 'Сигизмунд III Ваза', 'Август II Сильный', 'После смерти Стефана Батория  новым королем Речи Посполитой в 1587 г. был избран шведский принц Сигизмунд III Ваза (сын шведского короля Юхана III Вазы и Екатерины Ягеллонки). Он с детства был воспитан иезуитами в духе верности и преданности католичеству.', null, 1, 'Король Речи Посполитой, который был назван «иезуитским королем» и целенаправленно защищал интересы католической церкви, активно поддерживал Брестскую церковную унию, – это:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (173, 'проведении каждого третьего сейма Речи Посполитой в Гродно', 'запрещении в государстве всяких нововведений', 'уравнении прав диссидентской шляхты с католической', 'создании Скарбовой комиссии ВКЛ', 'Сейм Речи Посполитой 1764 г. принял решение не использовать «либерум вето» при рассмотрении экономических вопросов. Также была создана Скарбовая комиссия ВКЛ, которая контролировала финансы страны. Сейм ликвидировал частные пошлины и ввел единую таможенну', null, 1, 'Сейм Речи Посполитой 1764 г. принял решение о (об):', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (174, 'ликвидация помещичьего землевладения и передача земли крестьянам', 'вывод иностранных войск с территории Речи Посполитой', 'ликвидация монархии в государстве', 'провозглашение независимости ВКЛ', 'Первый раздел Речи Посполитой и присутствие иностранной армии на ее территории вызвали недовольство патриотически настроенных кругов общества, прежде всего шляхты, мещан и духовенства. В 1794 г. началось восстание, которое возглавил Т. Костюшко. Обнародов', null, 1, 'Определите одно из требований участников восстания 1794 г.:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (175, 'Ф. Скорина', 'М. Гусовский', 'С. Будный', 'С. Полоцкий', 'С 1560-х гг. в Несвиже действовала типография, основанная С. Будным совместно с несвижским наместником М. Кавечинским и проповедником Л. Крышковским. В ней использовали кириллические шрифты. Именно там в 1562 г. изданы знаменитый «Катехизис» и книга С. Бу', , 1, 'Определите автора книги, титульный лист которой представлен на иллюстрации:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (176, 'Расія атрымала выхад да Балтыйскага мора', 'ВКЛ страціла значную частку Заходніх тэрыторый', 'Расія атрымала выхад да Чорнага мора', 'ВКЛ вымушана было пайсці на унію з Польшчай', 'Лівонская вайна выявіла недастатковасць ўнутранага патэнцыялу ў ВКЛ для дасягнення поспеху ў ваенных дзеяннях. Палітычная эліта ВКЛ ўсведамляла неабходнасць знешняй падтрымкі з боку Польшчы для эфектыўнай барацьбы з Маскоўскай дзяржавай. Аднак польскі бок', null, 2, 'Вызначце наступствы Лівонскай вайны 1558-1583 гг.:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (177, 'прысваенне або адмена шляхецкіх званняў', 'увядзенне новых падаткаў', 'разгляд апеляцыйных спраў', 'кантроль за выкананнем функцый і абавязкаў манархам', 'У 1581 г. быў створаны Трыбунал ВКЛ - вышэйшая судовая ўстанова краіны. Гэта быў шляхецкі суд, які фармаваўся з прадстаўнікоў паветовай шляхты. Трыбунал ВКЛ разглядаў апеляцыйныя справы. Да іх ставіліся абскарджанне прысудаў мясцовых судоў, скаргі на злоў', null, 2, 'Вызначце адну з функцый Трыбунала ВКЛ:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (178, 'францысканцаў', 'езуітаў', 'піяраў', 'дамініканаў', 'З распаўсюджваннем рэфармацыйных ідэй каталіцкая царква пачала з імі актыўную барацьбу. У 1569 г. віленскі біскуп В. Пратасевіч запрасіў у ВКЛ 13 прадстаўнікоў ордэна езуітаў (члены каталіцкага манаскага ордэна Таварыства Ісуса, створанага для барацьбы з ', null, 2, 'Для барацьбы з рэфармацыйным рухам віленскі біскуп В. Пратасевіч у 1569 г. запрасіў у ВКЛ ордэн:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (179, 'Уреччы', 'Слуцку', 'Вішнёва', 'Налібаках', 'У ХVІІІ ст. да найбольш вядомых прадпрыемстваў належала Слуцкая мануфактура шаўковых паясоў, якую называлі персіярня. Гэтую мануфактуру М. К. Радзівіл адкрыў у пачатку 1760-х гг. Там выраблялі знакамітыя слуцкія паясы, дываны, «персідскую», «кітайскую» і ', , 2, 'Прадстаўленая на фатаграфіі прадукцыя была выраблена ў XVIII ст. на мануфактуры ў:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (180, 'узброеныя канфлікты паміж магнацкімі групоўкамі', 'увядзенне абмежаванняў на выкарыстанне права «ліберум вета»', 'усталяванне ў дзяржаве абсалютнай манархіі', 'пашырэнне правоў ніжэйшых саслоўяў', 'У другой палове XVII ст. агульнадзяржаўны сейм паступова губляў сваё значэнне. Выкарыстоўваючы права «лібэрум вета», шляхецкія паслы зрывалі яго пасяджэнні. Ва ўпраўленні ўнутранымі справамі Рэчы Паспалітай узрасло значэнне павятовых шляхецкіх соймікаў. К', null, 2, 'Сведчаннем палітычнага крызісу ў Рэчы Паспалітай у канцы XVII ст. з''яўляліся (- ась):', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (181, 'перавод навучання на беларускую мову', 'ўзмацненне кантролю царквы над адукацыяй', 'замацаванне прынцыпу саслоўнасці ў адукацыі', 'наданне адукацыі свецкага характару', 'Другая палова ХVІІІ ст. характарызуецца паступовым выхадам грамадскай думкі і адукацыі з-пад уплыву царквы. У 1773 г. загадам рымскага таты была забаронена дзейнасць езуітаў. Маёмасць ордэна перайшла да Адукацыйнай камісіі, якая лічылася першым у Еўропе с', null, 2, 'Вызначце адзін з вынікаў рэформы адукацыі 1770-1790-х гг. у Рэчы Паспалітай:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (182, 'збор паспалітага рушэння', 'разгляд скаргаў на злоўжыванні службовых асоб', 'кантроль за захаваннем шляхецкіх вольнасцяў', 'увядзенне новых падаткаў', 'Створаны ў 1581 г. Трыбунал Вялікага Княства Літоўскага з''яўляўся вышэйшым судовым установай краіны. Гэта быў шляхецкі суд, які фармаваўся з прадстаўнікоў павятовай шляхты. Суддзямі маглі стаць толькі ўраджэнцы ВКЛ, тэрмін іх дзейнасці абмяжоўваўся адным ', null, 2, 'Вызначце адну з функцый Трыбунала ВКЛ:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (183, 'францысканцаў', 'езуітаў', 'базыльянаў', 'дамініканаў', 'Ордэн базыльянаў (Св. Васіля Вялікага) быў створаны па ініцыятыве ўніяцкага мітрапаліта І. Руцкага пры падтрымцы І. Кунцэвіча з праваслаўных манахаў, якія прынялі унію. У 1617 г. быў прыняты Статут базыльянаў, распрацаваны на аснове правілаў святога Васіл', null, 2, 'У першай трэці XVII ст. уніяцкай царквой на землях Рэчы Паспалітай быў створаны манаскі ордэн:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (184, 'Уреччы', 'Слуцку', 'Вішнёва', 'Налібаках', 'Урэцкая мануфактура была заснавана ў 1737 г. ва ўладаннях А. Радзівіл і спачатку называлася люстраной. Гэта было першае прадпрыемства па вырабе люстэркаў у Рэчы Паспалітай. Тут выраблялі аконнае шкло, крыштальныя люстры, падсвечнікі, люстэркі, посуд і інш', , 2, 'Прадстаўленая на фатаграфіі прадукцыя была выраблена ў XVIII ст. на мануфактуры ў:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (185, 'усталяванне ў дзяржаве абсалютнай манархіі', 'паслабленне замежнага ўплыву на ўнутраныя справы дзяржавы', 'ліквідацыя Магдэбургскага права ў гарадах і мястэчках', 'дзейнасць шматлікіх шляхецкіх канфедэрацый', 'У XVIII ст. Рэч Паспалітая апынулася ў стане глыбокага палітычнага крызісу. Адной з яго прычын была нявырашанасць дысідэнцкага пытання. Дысідэнты (шляхта не каталіцкага веравызнання) атрымалі падтрымку суседніх дзяржаў, якія імкнуліся аслабіць Рэч Паспалі', null, 2, 'Сведчаннем палітычнага крызісу ў Рэчы Паспалітай XVIII ст. з''яўляліся (- ась):', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (186, 'перавод навучання на лацінскую мову', 'ўзмацненне кантролю царквы над адукацыяй', 'перавага ў навучанні натуральных і грамадскіх навук', 'увядзенне абавязковай пачатковай адукацыі', 'У 1773 г. была створана Эдукацыйная камісія, якая лічыцца першым у Еўропе свецкай установай у сферы асветы. У яе распараджэнне былі перададзены навучальныя ўстановы, якія раней належалі езуітам. Школьная адукацыя набыла нецаркоўны і всесословный характар,', null, 2, 'Вызначце адзін з вынікаў рэформы адукацыі 1770-1790-х гг. у Рэчы Паспалітай:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (187, 'Дзяржаўная дума', 'Пасольская Хата', 'Сенат', 'Найвышэйшая літоўская рада', 'Вышэйшым органам дзяржаўнай улады ў Рэчы Паспалітай з''яўляўся агульнадзяржаўны вальны сойм. Ён складаўся з Сената і Пасольскай хаты. Пасольская хата фармавалася з прадстаўнікоў шляхецкага саслоўя краіны.  У кожным павеце шляхта выбірала ў яе склад па два ', null, 2, 'Ніжняя палата сейма Рэчы Паспалітай, якая фармавалася з прадстаўнікоў шляхецкага саслоўя краіны, - гэта:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (188, 'ліквідацыя прыгоннага права', 'з''яўленне мануфактурнай вытворчасці', 'пашырэнне тавараабмену паміж горадам і вёскай', 'адсутнасць сацыяльных супярэчнасцяў паміж сялянамі і феадаламі', 'У другой палове XVI-першай палове XVII ст. сельская гаспадарка беларуска-літоўскіх зямель перажывала ўздым. Ён быў выкліканы пашырэннем абмену таварамі паміж горадам і вёскай, павелічэннем колькасці гарадскога насельніцтва, ростам попыту на збожжа як на ў', null, 2, 'Вызначце адну з прычын уздыму ў развіцці гаспадаркі ВКЛ у другой палове XVI-першай палове XVII ст.:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (189, 'К. Астрожскі', 'Н. Радзівіл Чорны', 'А. Гаштольд', 'А. Тызенгаўз', 'Мікалай Радзівіл Чорны - віленскі ваявода і канцлер ВКЛ, мецэнат. Узначаліў камісію па правядзенні аграрнай рэформы. Быў праціўнікам дзяржаўнай уніі з Польшчай. Адстойваў самастойнасць ВКЛ. Першапачаткова далучыўся да лютэранства, а затым перайшоў у кальв', null, 2, 'Дзяржаўны дзеяч ВКЛ, прадстаўнік вядомага магнацкага роду, лідэр кальвінізму ў ВКЛ – гэта:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (190, 'невыкарыстанні права «ліберум вета» пры разглядзе эканамічных пытанняў', 'раўнанні правоў дысідэнцкай шляхты з каталіцкай;', 'увядзенні польскай мовы ў справаводства ВКЛ', 'правядзенні кожнага трэцяга сейма Рэчы Паспалітай ў Гродне', 'На сейме ў 1764 г. у Рэчы Паспалітай было прынята рашэнне не выкарыстоўваць права "ліберум вета" пры разглядзе эканамічных пытанняў. Зараз для ўвядзення новых падаткаў або стварэння кантралюючых органаў улады патрабавалася адабрэнне шляхецкіх паслоў больш', null, 2, 'Сейм Рэчы Паспалітай 1764 г. прыняў рашэнне аб (аб):', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (191, 'абвяшчэнне незалежнасці ВКЛ', 'устанаўленне ў краіне дэмакратычнай рэспублікі', 'вяртанне Рэчы Паспалітай аднятых зямель', 'перадача сялянам памешчыцкай зямлі ва ўласнасць', 'Паўстанне 1794 г. пачалося з абвяшчэння Т. Касцюшкам "акту паўстання" ў Кракаве. Дакумент вызначыў мэта выступу – аднаўленне Рэчы Паспалітай у межах 1772 г. Рэалізацыя «Акту паўстання» патрабавала вываду замежных войскаў, вяртання адабраных зямель, ажыцця', null, 2, 'Вызначце адно з патрабаванняў удзельнікаў паўстання 1794 г.:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (192, 'Ф. Скарына', 'М. Гусоўскі', 'С. Будны', 'С. Полацкі', 'С. Полацкі ў 1664 г. перасяліўся ў Маскву. У расійскай сталіцы паэт заснаваў "лацінскую" школу пры Заіканаспаскім манастыры, друкарню. С. Полацкі свае творы пісаў на старабеларускай, польскай і лацінскай мовах. Да нашчадкаў дайшлі два вялікіх зборніка вер', , 2, 'Вызначыце аўтара кнігі, тытульны ліст якой прадстаўлены на ілюстрацыі:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (193, 'Дзяржаўная дума', 'Пасольская Хата', 'Сенат', 'Найвышэйшая літоўская рада', 'Вышэйшым органам дзяржаўнай улады ў Рэчы Паспалітай з''яўляўся агульнадзяржаўны вальны сойм. На ім прадстаўнікі шляхты аб''яўлялі вайну, заключалі мірныя пагадненні з іншымі краінамі, давалі згоду на збор паспалітага рушэння, увядзення ваеннага падатку, пры', null, 2, 'Вышэйшая палата сойму Рэчы Паспалітай, у якую ўваходзілі прадстаўнікі вышэйшага каталіцкага духавенства, вышэйшыя службовыя асобы дзяржавы, - гэта:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (194, 'рост попыту на збожжа на ўнутраным рынку і ў Заходняй Еўропе', 'з''яўленне мануфактурнай вытворчасці', 'адсутнасць сацыяльных супярэчнасцяў паміж сялянамі і феадаламі', 'паслабленне феадальнага прыгнёту', 'У другой палове XVI - першай палове XVII ст. сельская гаспадарка беларуска-літоўскіх зямель перажывала ўздым. Ён быў выкліканы пашырэннем абмену таварамі паміж горадам і вёскай, павелічэннем колькасці гарадскога насельніцтва, ростам попыту на збожжа як на', null, 2, 'Вызначце адну з прычын уздыму ў развіцці гаспадаркі ВКЛ у другой палове XVI-першай палове XVII ст.:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (195, 'Жыгімонт I Стары', 'Стэфан Баторый', 'Жыгімонт III Ваза', 'Аўгуст II Моцны', 'Пасля смерці Стэфана Баторыя новым каралём Рэчы Паспалітай у 1587 г. быў абраны шведскі прынц Жыгімонт III Ваза (сын шведскага караля Юхана III Вазы і Кацярыны Ягелонкі). Ён з дзяцінства быў выхаваны езуітамі ў духу вернасці і адданасці каталіцтву. У Рэчы', null, 2, 'Кароль Рэчы Паспалітай, які быў названы "езуіцкім каралём" і мэтанакіравана абараняў інтарэсы каталіцкай царквы, актыўна падтрымліваў Брэсцкую царкоўную унію, - гэта:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (196, 'правядзенні кожнага трэцяга сойма Рэчы Паспалітай ў Гродне', 'забароне ў дзяржаве усялякіх новаўвядзенняў', 'раўнанні правоў дысідэнцкай шляхты з каталіцкай', 'стварэнні Скарбавай камісіі ВКЛ', 'Сейм Рэчы Паспалітай 1764 г. прыняў рашэнне не выкарыстоўваць "ліберум вета" пры разглядзе эканамічных пытанняў. Таксама была створана Скарбовая камісія ВКЛ, якая кантралявала фінансы краіны. Сейм ліквідаваў прыватныя пошліны і ўвёў адзіную мытную пошліну', null, 2, 'Сейм Рэчы Паспалітай 1764 г. прыняў рашэнне аб (аб):', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (197, 'ліквідацыя памешчыцкага землеўладання і перадача зямлі сялянам', 'вывад замежных войскаў з тэрыторыі Рэчы Паспалітай', 'ліквідацыя манархіі ў дзяржаве', 'абвяшчэнне незалежнасці ВКЛ', 'Першы падзел Рэчы Паспалітай і прысутнасць замежнай арміі на яе тэрыторыі выклікалі незадаволенасць патрыятычна настроеных колаў грамадства, перш за ўсё шляхты, мяшчан і духавенства. У 1794 г. пачалося паўстанне, якое ўзначаліў Т. Касцюшка. Апублікаваны ў', null, 2, 'Вызначце адно з патрабаванняў удзельнікаў паўстання 1794 г.:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (198, 'Ф. Скарына', 'М. Гусоўскі', 'С. Будны', 'С. Полацкі', 'З 1560-х гг. у Нясвіжы дзейнічала друкарня, заснаваная С. Будным сумесна з Нясвіжскім намеснікам М. Кавечынскім і прапаведнікам Л. Крышкоўскім. У ёй выкарыстоўвалі кірылічныя шрыфты. Менавіта там у 1562 г. выдадзены знакаміты "Катэхізіс" і кніга С. Буднаг', , 2, 'Вызначыце аўтара кнігі, тытульны ліст якой прадстаўлены на ілюстрацыі:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (199, 'автономистов', 'декабристов', 'диссидентов', 'национал-демократов', 'В I Государственной думе депутаты от украинских, польских, прибалтийских и мусульманских губерний создали группу автономистов. В ее состав вошли 15 из 36 депутатов от белорусских губерний. Они выступали за автономию Белорусского края, подчеркивали, что им', null, 1, 'Депутаты от национальных окраин в I Государственной  думе (1906), в том числе почти половина депутатов от Беларуси, создали группу:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (200, 'ликвидацию крепостного права', 'получение автономии Беларуси в составе Российской империи', 'установление социалистического строя путем мирных реформ', 'свержение самодержавия и осуществление демократических преобразований', 'В 1879 г. произошел раскол общероссийской народнической организации «Земля и воля» на две: «Черный передел» и «Народная воля». Вначале большинство народников Беларуси поддержали «Черный передел», однако после его распада перешли на позиции «Народной воли»', null, 1, 'Организация «Народная  воля» в конце 1870-х  –начале 1880-х  гг. ставила своей целью:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (201, 'сокращение количества помещичьего землевладения', 'разрушение сельской общины (громады)', 'улучшение экономического положения крестьян в государственной деревне', 'переход сельского хозяйства на американский путь развития', 'В 1840–1857 гг. была проведена реформа в государственной деревне. Инициатором и основным ее проводником стал министр государственных имуществ П. Киселев. В ходе реформы было проведено описание государственных владений, уменьшались повинности крестьян и ув', null, 1, 'Определите итог аграрной реформы П. Киселева в 1840 – 1857 гг.:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (202, 'М. Волович', 'Ф. Савич', 'Ф. Рожанский', 'И. Домейко', 'Михаил Волович – уроженец Слонимщины, представитель древнего белорусского шляхетского рода. Участвовал в восстании 1830–1831 гг. в составе отряда генерала А. Гелгуда. После поражения восстания выехал во Францию, в 1833 г. тайно вернулся на родину. Выступа', null, 1, 'Участник восстания 1830 – 1831 гг., руководитель крестьянского партизанского отряда в Слонимско-Новогрудском округе в 1833 г. – это:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (203, 'жестоких боев между русской и французской армиями', 'народных восстаний против французских оккупантов', 'соединения 1-й и 2-й русских армий', 'проведения мирных переговоров между французским и русским командованием', '10 июня 1812 г. Франция объявила войну Российской империи, а 12 июня 1812 г. армия Наполеона переправилась через Неман и ворвалась в пределы России. Территория Беларуси стала ареной военных действий. 15 июля 1812 г. дивизии 3-й русской армии под командова', null, 1, 'Во время войны 1812 г. населенные пункты Кобрин, Салтановка – это места:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (204, 'диктатуры пролетариата', 'двоевластия', 'ограниченной монархии', 'диктатуры Л. Корнилова', 'Политическая обстановка, сложившаяся после победы Февральской революции 1917 г., характеризовалась установлением в стране двоевластия. С одной стороны, революционно-демократическую власть представляли местные Советы, опиравшиеся на рабочих, солдат и крест', null, 1, 'Политическое положение, которое сложилось после победы Февральской революции 1917 г., характеризовалось установлением в стране:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (205, 'преобладание католиков в конфессиональном составе населения', 'занятость большинства белорусов в промышленном производстве', 'отсутствие собственной государственности', 'лидерство белорусской буржуазии в развитии белорусского национального движения', 'Нация представляет собой общность людей, которая исторически является преемницей народности. В процессе формирования нация постепенно превращается в политическую общность людей, главным признаком которой становится собственная государственность. Белорусск', null, 1, 'Определите особенность формирования белорусской нации во второй половине XIX – начале XX в.:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (206, 'конфедерациями', 'комитетами спасения революции', 'временными управами', 'коалиционными комитетами', 'В ходе первой российской революции 1905–1907 гг. представители большевиков и меньшевиков, бундовцы, эсеры выступали с требованиями уничтожения самодержавия, установления демократической республики, ликвидации помещичьего землевладения, а РСДРП к тому же о', null, 1, 'Объединения политических партий для достижения общих политических и экономических целей в ходе первой российской революции 1905–1907 гг. назывались:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (207, 'пропаганды социалистических идей среди крестьянства', 'исследования фольклора, обычаев и верований белорусского народа', 'пропаганды передовых методов ведения сельского хозяйства', 'расширения своего влияния среди рабочих в промышленных центрах', 'Многие из белорусских народников стали участниками «хождения в народ» с целью пропаганды социалистических идей среди крестьянства. «Хождение в народ» закончилось провалом. Крестьяне еще продолжали верить в «доброго царя» и поэтому выдавали народников поли', null, 1, 'Белорусские народники в 1870-е гг. участвовали в «хождении  в  народ» с целью:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (208, 'освобождение крестьян от крепостной зависимости', 'повышение доходности казенных имений', 'разрушение сельской общины (громады)', 'формирование класса сельской буржуазии из зажиточного крестьянства', 'В 1840–1857 гг. была проведена реформа положения государственных крестьян, составлявших около 1/5 всего крестьянства Беларуси. Государственные крестьяне пользовались казенными землями, а казенные имения почти все сдавались частным лицам в аренду. Поэтому ', null, 1, 'Одной из целей проведения аграрной реформы П. Киселева в 1840–1857 гг. являлось:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (209, 'М. Волович', 'В. Врублевский', 'Ф. Савич', 'М. Рукевич', 'В Литовском отдельном корпусе, размещенном на Белосточчине, по инициативе филарета М. Рукевича возникло тайное Общество военных друзей. Члены общества выступали за свободу и просвещение для себя и других. 24 декабря 1825 г. «военные друзья» сорвали церемо', null, 1, 'Член тайных обществ филоматов и филаретов, один из организаторов Общества военных друзей в Литовском отдельном корпусе в 1825 г. – это:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (210, 'жестоких боев между русской и французской армиями', 'народных восстаний против французских оккупантов', 'соединения 1-й и 2-й русских армий', 'проведения мирных переговоров между французским и русским командованием', '10 июня 1812 г. Франция объявила войну Российской империи,  а 12 июня 1812 г. армия Наполеона переправилась через Неман и ворвалась в пределы России. Территория Беларуси стала ареной военных действий. Во время отступления в июне  –  июле русские войска ве', null, 1, 'Во время войны 1812 г. населенные пункты Мир, Клястицы – это места:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (211, 'магдебургское право', 'сословное деление общества', 'крепостное право', 'рекрутская повинность', 'После присоединения к Российской империи на белорусских землях было упразднено магдебургское право. На города, его имевшие, и местечки, признанные центрами уездов, распространялась система российского городского управления (с определенными формами самоупр', null, 1, 'Сразу после присоединения к Российской империи на белорусских землях было(-а) ликвидировано(-а):', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (212, 'ликвидация барщинной системы хозяйствования в помещичьей деревне', 'углубление имущественного расслоения крестьян', 'сокращение', 'отмена дополнительных крестьянских повинностей', 'С развитием товарно-денежных отношений, обезземеливанием части крестьянских дворов при разном обеспечении их рабочим скотом углублялась имущественная дифференциация крестьянства. Во второй половине 1850-х гг. в Беларуси было более 100 тыс. безземельных кр', null, 1, 'Для развития сельского хозяйства Беларуси в первой половине XIX в. была(-о) характерна(-о):', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (213, '1', '2', '3', '4', 'Проблемой начального образования в Беларуси был недостаток учителей. В 1864 г. в Молодечно открылась первая на территории Российской империи учительская семинария. Учащимися семинарии были исключительно православные крестьянские юноши. При семинарии сущес', , 1, 'Город, в котором в 1864 г. открылась первая на территории Российской империи учительская семинария, обозначен на картосхеме цифрой:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (214, 'крестьянской', 'городской', 'судебной', 'земской', 'Российское правительство в XIX в. не пошло на проведение в белорусских губерниях земской реформы, связанной с созданием выборных учреждений для управления местным хозяйством, народным образованием, медицинским обслуживанием населения. Власти после восстан', null, 1, 'Царское правительство во второй половине XIX в. не пошло на проведение на белорусских землях реформы:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (215, 'использование паровых двигателей', 'проведение ярмарок', 'строительство железных дорог', 'введение подушного налога', 'На территории Беларуси во второй половине XIX – начале XX в. началось интенсивное строительство железных дорог. Первая железная дорога – участок Петербургско-Варшавской магистрали – прошла  через  Беларусь  в  1862  г. Со строительством в 1860-е гг. Риго-', null, 1, 'Новым явлением в развитии экономики на территории Беларуси во второй половине XIX – начале XX в. явилось:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (216, 'военные действия Первой мировой войны начались на территории Беларуси летом 1916 г.', 'в годы Первой мировой войны защита города Сморгони от германской армии продолжалась 810 дней', 'наступательная операция российской армии в марте 1916 г. в районе озера Нарочь принесла значительные успехи', 'к концу 1915 г. почти вся восточная часть Беларуси была оккупирована германской армией', 'В годы Первой мировой войны наступательная операция германской армии, известная под названием «Свенцянский прорыв», создала угрозу захвата Минска. Огромными усилиями российским войскам удалось отбросить противника в район озер Свирь и Нарочь и ликвидирова', null, 1, 'Определите правильное утверждение:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (217, 'создание независимого белорусского государства', 'отказ от сотрудничества с Временным правительством', 'национально-территориальную автономию для Беларуси в составе России', 'незамедлительный выход России из Первой мировой войны', 'В июле 1917 г. в Минске состоялся ІІ съезд белорусских национальных организаций и партий. Он принял предложение об осуществлении национально-территориальной автономии – широкого внутреннего самоуправления для Беларуси в составе Российского государства – и', null, 1, 'II съезд белорусских национальных организаций, состоявшийся в июле 1917 г. в Минске, высказался за:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (218, 'подворное налогообложение', 'помещичье землевладение', 'крепостное право', 'сословное деление общества', 'Белорусские крестьяне, как и другие податные сословия, интересовали власти Российской империи прежде всего с точки зрения пополнения доходов казны. В Беларуси вместо ранее существовавшего налога с каждого двора была введена подушная подать с каждой души м', null, 1, 'На белорусских землях сразу после присоединения к Российской империи было упразднено:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (219, 'сокращение площади пахотных земель', 'углубление хозяйственной специализации', 'сокращение норм повинностей крепостных крестьян', 'значительное повышение прибыльности всех помещичьих хозяйств', 'В первой половине ХІХ в. сельское хозяйство в Беларуси все более связывалось с рынком, увеличивалась площадь пахотных земель. Постепенно определялась хозяйственная специализация белорусских земель по производству определенной продукции. Во многих имениях ', null, 1, 'Для развития сельского хозяйства Беларуси в первой половине XIX в. была(-о) характерна(-о):', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (220, '1', '2', '3', '4', 'Полоцкий иезуитский коллегиум был преобразован в иезуитскую академию, которая действовала в 1812–1820 гг. Академии были предоставлены права университета, она имела три факультета: теологический, философский, вольных наук и древних и современных языков. Фо', , 1, 'Город, в котором в 1812–1820 гг. действовала иезуитская академия, обозначен на картосхеме цифрой:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (221, 'имели более глубокий демократический характер', 'были проведены раньше, чем в других губерниях России', 'не имели существенных ограничений', 'были проведены позже, чем в других губерниях России', 'До конца 1860-х гг. в Беларуси сохранялось военное положение, введенное в связи с восстанием 1863–1864 гг. В Беларуси и Литве был установлен режим исключительных законов, направленный на уменьшение польского шляхетского влияния. Такое политическое положен', null, 1, 'Буржуазные реформы 1860– 1870-х гг. в белорусских губерниях:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (222, 'садоводстве и огородничестве', 'птицеводстве', 'мясо-молочном животноводстве', 'пчеловодстве', 'В 1860–1870-е гг. сельское хозяйство Беларуси специализировалось на производстве зерна. Однако в 1880-х гг. его производство как рыночной культуры стало в Беларуси невыгодным. Европейские рынки заполнило более качественное и дешевое зерно из Америки, а вн', null, 1, 'Сельское хозяйство Беларуси в конце ХIХ – начале ХХ в. специализировалось на:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (223, 'военные действия Первой мировой войны начались на территории Беларуси летом 1915 г.', 'в 1916 г., впервые на Восточном фронте, под Вилейкой германские войска применили отравляющий газ', 'германская оккупационная власть в годы Первой мировой войны помогала созданию независимого белорусского государства', 'в начале Первой мировой войны в поддержку царского правительства выступили все политические партии', 'С первых дней войны, которая для Российской империи началась 19 июля (1 августа) 1914 г., белорусские губернии были переведены на военное положение. Был установлен жесткий военно- полицейский режим, запрещена деятельность политических партий, собрания и м', null, 1, 'Определите правильное утверждение:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (224, 'незамедлительный выход России из Первой мировой войны', 'создание независимого белорусского государства', 'недоверие к политике Временного правительства', 'автономию Беларуси в составе Российской федеративной демократической республики', 'Важную роль в развитии белорусского национального движения сыграл съезд белорусских национальных организаций, состоявшийся в марте 1917 г. в Минске. Съезд принял декларацию в поддержку Временного правительства. Также он высказался за автономию Беларуси в ', null, 1, 'I съезд белорусских национальных организаций, который состоялся в марте 1917 г. в Минске, высказался за:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (225, 'аўтанамістаў', 'дзекабрыстаў', 'дысідэнтаў', 'нацыянал-дэмакратаў', 'У I Дзяржаўнай думе дэпутаты ад украінскіх, польскіх, прыбалтыйскіх і мусульманскіх губерняў стварылі групу аўтанамiстаў. У яе склад увайшлі 15 з 36 дэпутатаў ад беларускіх губерняў. Яны выступалі за аўтаномію беларускага краю, падкрэслівалі, што ім павін', null, 2, 'Дэпутаты ад нацыянальных ускраін у I Дзяржаўнай думе (1906), у тым ліку амаль палова дэпутатаў ад Беларусі, стварылі групу:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (226, 'ліквідацыю прыгоннага права', 'атрыманне аўтаноміі Беларусі ў складзе Расійскай імперыі', 'усталяванне сацыялістычнага ладу шляхам мірных рэформаў', 'звяржэнне самадзяржаўя і ажыццяўленне дэмакратычных пераўтварэнняў', 'У 1879 г. адбыўся раскол агульнарасійскай народніцкай арганізацыі «Зямля і воля» на дзве: «Чорны перадзел» і «Народная воля». Спачатку большасць народнікаў у Беларусі падтрымала «Чорны перадзел», аднак пасля яго распаду перайшлі на пазіцыі «Народнай волі»', null, 2, 'Арганізацыя "Народная воля" у канцы 1870 –х-пачатку 1880-х гг. ставіла сваёй мэтай:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (227, 'скарачэнне колькасці памешчыцкага землеўладання', 'разбурэнне сельскай абшчыны (грамады)', 'паляпшэнне эканамічнага становішча сялян у дзяржаўнай вёсцы', 'пераход сельскай гаспадаркі на амерыканскі шлях развіцця', 'У 1840-1857 гг. была праведзена рэформа ў дзяржаўнай вёсцы. Ініцыятарам і асноўным яе правадыром стаў міністр дзяржаўных маёмасцяў П. Кісялёў. У ходзе рэформы было праведзена апісанне дзяржаўных уладанняў, змяншаліся павіннасці сялян і павялічваліся іх зя', null, 2, 'Вызначыце вынік аграрнай рэформы П. Кісялёва ў 1840-1857 гг.:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (228, 'М. Валовіч', 'Ф. Савіч', 'Ф. Ражанскі', 'І. Дамейка', 'Міхаіл Валовіч - ураджэнец Слонімшчыны, прадстаўнік старажытнага беларускага шляхецкага роду. Удзельнічаў у паўстанні 1830-1831 гг. у складзе атрада генерала А. Гелгуда. Пасля паразы паўстання выехаў у Францыю, у 1833 г. таемна вярнуўся на радзіму. Выступ', null, 2, 'Удзельнік паўстання 1830-1831 гг., кіраўнік сялянскага партызанскага атрада ў Слонімска-Навагрудскай акрузе ў 1833 г. - гэта:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (229, 'жорсткіх баёў паміж рускай і французскай войскамі', 'народных паўстанняў супраць французскіх акупантаў', 'злучэння 1-й і 2-й рускіх армій', 'правядзення мірных перамоваў паміж французскім і рускім камандаваннем', '10 чэрвеня 1812 г. Францыя аб''явіла вайну Расійскай імперыі, а 12 чэрвеня 1812 г. войска Напалеона пераправілася праз Нёман і ўварвалася ў межы Расіі. Тэрыторыя Беларусі стала арэнай ваенных дзеянняў. 15 ліпеня 1812 г. дывізіі 3-й рускай арміі пад каманда', null, 2, 'Падчас вайны 1812 г. населеныя пункты Кобрын, Салтановка - гэта месцы:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (230, 'дыктатуры пралетарыяту', 'двоеўладдзя', 'абмежаванай манархіі', 'дыктатуры Л. Карнілава', 'Палітычная абстаноўка, якая склалася пасля перамогі Лютаўскай рэвалюцыі 1917 г., характарызавалася усталяваннем у краіне двоеўладдзя. З аднаго боку, рэвалюцыйна-дэмакратычную ўладу прадстаўлялі мясцовыя Саветы, якія абапіраліся на працоўных, салдат і сяля', null, 2, 'Палітычнае становішча, якое склалася пасля перамогі Лютаўскай рэвалюцыі 1917 г., характарызавалася ўсталяваннем ў краіне:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (231, 'перавага каталікоў у канфесійнай складзе насельніцтва', 'занятасць большасці беларусаў у прамысловай вытворчасці', 'адсутнасць уласнай дзяржаўнасці', 'лідарства беларускай буржуазіі ў развіцці беларускага нацыянальнага руху', 'Нацыя ўяўляе сабой супольнасць людзей, якая гістарычна з''яўляецца пераемніцай народнасці. У працэсе фарміравання нацыя паступова ператвараецца ў палітычную агульнасць людзей, галоўнай прыкметай якой становіцца ўласная дзяржаўнасць. Беларуская нацыя фармір', null, 2, 'Вызначце асаблівасць фарміравання беларускай нацыі ў другой палове XIX-пачатку XX ст.:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (232, 'канфедэрацыямі', 'камітэтамі выратавання рэвалюцыі', 'часовымі ўправамі', 'кааліцыйнымі камітэтамі', 'У ходзе першай расійскай рэвалюцыі 1905-1907 гг. прадстаўнікі бальшавікоў і меншавікоў, бундаўцы, эсэры выступалі з патрабаваннямі знішчэння самадзяржаўя, ўстанаўлення дэмакратычнай рэспублікі, ліквідацыі памешчыцкага землеўладання, а РСДРП да таго ж адст', null, 2, 'Аб''яднання палітычных партый для дасягнення агульных палітычных і эканамічных мэтаў у ходзе першай расійскай рэвалюцыі 1905-1907 гг. называліся:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (233, 'прапаганды сацыялістычных ідэй сярод сялянства', 'даследаванні фальклору, звычаяў і вераванняў беларускага народа', 'прапаганды перадавых метадаў вядзення сельскай гаспадаркі', 'пашырэння свайго ўплыву сярод рабочых у прамысловых цэнтрах', 'Многія з беларускіх народнікаў сталі ўдзельнікамі "хаджэння ў народ" з мэтай прапаганды сацыялістычных ідэй сярод сялянства. "Хаджэнне ў народ" скончылася правалам. Сяляне яшчэ працягвалі верыць у "добрага цара" і таму выдавалі народнікаў паліцыі', null, 2, 'Беларускія народнікі ў 1870-я гг. удзельнічалі ў "хадні ў народ" з мэтай:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (234, 'вызваленне сялян ад прыгоннай залежнасці', 'павышэнне даходнасці казённых маёнткаў', 'разбурэнне сельскай абшчыны (грамады)', 'фарміраванне класа сельскай буржуазіі з заможнага сялянства', 'У 1840-1857 гг. была праведзена рэформа становішча дзяржаўных сялян, якія складалі каля 1/5 усяго сялянства Беларусі. Дзяржаўныя сяляне карысталіся казённымі землямі, а казённыя маёнткі амаль усе здаваліся прыватным асобам у арэнду. Таму эканамічнае і пра', null, 2, 'Адной з мэтаў правядзення аграрнай рэформы П. Кісялёва ў 1840-1857 гг. з''яўлялася:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (235, 'М. Валовіч', 'В. Урублеўскі', 'Ф. Савіч', 'М. Рукевіч', 'У Літоўскім асобным корпусе, размешчаным на Беласточчыне, з ініцыятывы Філарэта М. Рукевіч паўстала таемнае Грамадства ваенных сяброў. Сябры таварыства выступалі за свабоду і асвету для сябе і іншых. 24 снежня 1825 г. "ваенныя сябры» сарвалі цырымонію пры', null, 2, 'Член таемных таварыстваў філаматаў і філарэтаў, адзін з арганізатараў Таварыства ваенных сяброў у Літоўскім асобным корпусе ў 1825 г. - гэта:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (236, 'жорсткіх баёў паміж рускай і французскай войскамі', 'народных паўстанняў супраць французскіх акупантаў', 'злучэння 1-й і 2-й рускіх армій', 'правядзення мірных перамоваў паміж французскім і рускім камандаваннем', '10 чэрвеня 1812 г. Францыя аб''явіла вайну Расійскай імперыі, а 12 чэрвеня 1812 г. войска Напалеона пераправілася праз Нёман і ўварвалася ў межы Расіі. Тэрыторыя Беларусі стала арэнай ваенных дзеянняў. Падчас адступлення ў чэрвені - ліпені рускія войскі вя', null, 2, 'Падчас вайны 1812 г. населеныя пункты Мір, Клясціцы-гэта месцы:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (237, 'магдэбургскае права', 'саслоўнае дзяленне грамадства', 'прыгоннае права', 'прыгоннае права', 'Пасля далучэння да Расійскай імперыі на беларускіх землях было скасавана магдэбургскае права. На гарады, якiя яго мелі, і мястэчкі, прызнаныя цэнтрамі паветаў, распаўсюджвалася сістэма расійскага гарадскога кіравання (з пэўнымі формамі самакіравання). Жых', null, 2, 'Адразу пасля далучэння да Расійскай імперыі на беларускіх землях было (- а) ліквідавана:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (238, 'ліквідацыя паншчыннай сістэмы гаспадарання ў памешчыцкай вёсцы', 'паглыбленне маёмаснага расслаення сялян', 'скарачэнне пасеваў тэхнічных культур', 'адмена дадатковых сялянскіх павіннасцяў', 'У другой палове 1850-х гг. у Беларусі было больш за 100 тыс. беззямельных сялян-бабылёў. Для большасці беззямельных і малазямельных сялян асноўнай крыніцай існавання з''яўлялася наёмная праца. Вылучалася праслойка заможнага сялянства, якое мела вялікія над', null, 2, 'Для развіцця сельскай гаспадаркі Беларусі ў першай палове XIX ст. была(-о) характэрная (- а):', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (239, '1', '2', '3', '4', 'Праблемай пачатковай адукацыі ў Беларусі быў недахоп настаўнікаў. У 1864 г. у Маладзечне адкрылася першая на тэрыторыі Расійскай імперыі настаўніцкая семінарыя. Навучэнцамі семінарыі былі выключна праваслаўныя сялянскія юнакі. Пры семінарыі існавала народ', , 2, 'Горад, у якім у 1864 г. адкрылася першая на тэрыторыі Расійскай імперыі настаўніцкая семінарыя, пазначаны на картасхеме лічбай:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (240, 'сялянскай', 'гарадской', 'судовай', 'земскай', 'Расейскі ўрад у XIX ст. не пайшоў на правядзенне ў беларускіх губернях земскай рэформы, звязанай са стварэннем выбарных устаноў для кіравання мясцовай гаспадаркай, народнай адукацыяй, медыцынскім абслугоўваннем насельніцтва. Улады пасля паўстання 1863-186', null, 2, 'Царскі ўрад у другой палове XIX ст. не пайшоў на правядзенне на беларускіх землях рэформы:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (241, 'выкарыстанне паравых рухавікоў', 'правядзенне кірмашоў', 'будаўніцтва чыгунак', 'увядзенне падушнага падатку', 'На тэрыторыі Беларусі ў другой палове XIX – пачатку XX ст. пачалося інтэнсіўнае будаўніцтва чыгунак. Першая чыгунка – участак Пецярбургска-Варшаўскай магістралі – прайшла праз Беларусь у 1862 г. З пабудовай у 1860-я гг. Рыга-Арлоўскай, у 1870-я гг. Маскоў', null, 2, 'Новай з''явай у развіцці эканомікі на тэрыторыі Беларусі ў другой палове XIX-пачатку XX ст. з''явілася:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (242, 'ваенныя дзеянні Першай сусветнай вайны пачаліся на тэрыторыі Беларусі летам 1916 г.', 'у гады Першай сусветнай вайны абарона горада Смаргоні ад германскай арміі працягвалася 810 дзён', 'наступальная аперацыя расійскай арміі ў сакавіку 1916 г. у раёне возера Нарач прынесла значныя поспехі', 'да канца 1915 г. амаль уся ўсходняя частка Беларусі была акупаваная германскай арміяй', 'У гады Першай сусветнай вайны наступальная аперацыя германскай арміі, вядомая пад назвай "Свянцянскі прарыў", стварыла пагрозу захопу Мінска. Вялізнымі намаганнямі расійскім войскам удалося адкінуць праціўніка ў раён азёр Свір і Нарач і ліквідаваць прарыў', null, 2, 'Вызначце правільнае сцвярджэнне:', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (243, 'стварэнне незалежнай беларускай дзяржавы', 'адмову ад супрацоўніцтва з Часовым урадам', 'нацыянальна-тэрытарыяльную аўтаномію для Беларусі ў складзе Расіі', 'неадкладны выхад Расіі з Першай сусветнай вайны', 'У ліпені 1917 г. у Мінску адбыўся ІІ з''езд беларускіх нацыянальных арганізацый і партый. Ён прыняў прапанову аб ажыццяўленні нацыянальна-тэрытарыяльнай аўтаноміі-шырокага ўнутранага самакіравання для Беларусі ў складзе Расійскай дзяржавы - і падкрэсліў не', null, 2, 'II з''езд беларускіх нацыянальных арганізацый, які адбыўся ў ліпені 1917 г. у Менску, выказаўся за:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (244, 'падворнае падаткаабкладанне', 'памешчыцкае землеўладанне', 'прыгоннае права', 'саслоўнае дзяленне грамадства', 'Беларускія сяляне, як і іншыя податные саслоўя, цікавілі ўлады Расійскай імперыі перш за ўсё з пункту гледжання папаўнення даходаў казны. У Беларусі замест раней існаваўшага падатку з кожнага двара была ўведзена подушная падаць з кожнай душы мужчынскага п', null, 2, 'На беларускіх землях адразу пасля далучэння да Расійскай імперыі было скасавана:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (245, 'скарачэнне плошчы ворных зямель', 'паглыбленне гаспадарчай спецыялізацыі', 'скарачэнне нормаў павіннасцей прыгонных сялян', 'значнае павышэнне прыбытковасці ўсіх памешчыцкіх гаспадарак', 'У першай палове ХІХ ст. сельская гаспадарка ў Беларусі ўсё больш звязвалася з рынкам, павялічвалася плошча ворных зямель. Паступова вызначалася гаспадарчая спецыялізацыя беларускіх зямель па вытворчасці пэўнай прадукцыі. У многіх маёнтках Віцебскай, Вілен', null, 2, 'Для развіцця сельскай гаспадаркі Беларусі ў першай палове XIX ст. была(-о) характэрная (- а):', 2);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (246, '1', '2', '3', '4', 'Полацкі езуіцкі калегіум быў ператвораны ў езуіцкую акадэмію, якая дзейнічала ў 1812-1820. Акадэміі былі прадастаўлены правы універсітэта, яна мела тры факультэты: тэалагічны, філасофскі, вольных навук і старажытных ды сучасных моў. Фармальна навучанне бы', , 2, 'Горад, у якім у 1812-1820 гг. дзейнічала езуіцкая акадэмія, пазначаны на картосхеме лічбай:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (247, 'мелі больш глыбокі дэмакратычны характар', 'былі праведзены раней, чым у іншых губернях Расіі', 'не мелі істотных абмежаванняў', 'былі праведзены пазней, чым у іншых губернях Расіі', 'Да канца 1860-х гг. у Беларусі захоўвалася ваеннае становішча, уведзенае ў сувязі з паўстаннем 1863-1864 гг. у Беларусі і Літве быў усталяваны рэжым выключных законаў, накіраваных на змяншэнне польскага шляхецкага ўплыву. Такое палітычнае становішча накла', null, 2, 'Буржуазныя рэформы 1860-1870-х гг. у беларускіх губернях:', 4);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (248, 'садоўніцтве і агародніцтва', 'птушкагадоўлі', 'мяса-малочнай жывёлагадоўлі', 'пчалярстве', 'У 1860-1870-я гг. сельская гаспадарка Беларусі спецыялізавалася на вытворчасці збожжа. Аднак у 1880-х гг. яго вытворчасць як рынкавай культуры стала ў Беларусі нявыгаднай. Еўрапейскія рынкі запоўніла больш якаснае і таннае збожжа з Амерыкі, а ўнутраны рын', null, 2, 'Сельская гаспадарка Беларусі ў канцы ХІХ-пачатку ХХ ст. спецыялізавалася на:', 3);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (249, 'ваенныя дзеянні Першай сусветнай вайны пачаліся на тэрыторыі Беларусі летам 1915 г.', 'у 1916 г., упершыню на Усходнім фронце, пад Вілейкай германскія войскі выкарысталі атрутны газ', 'германская акупацыйная ўлада ў гады Першай сусветнай вайны дапамагала стварэнню незалежнай беларускай дзяржавы', 'у пачатку Першай сусветнай вайны ў падтрымку царскага ўрада выступілі ўсе палітычныя партыі', 'З першых дзён вайны, якая для Расійскай імперыі пачалася 19 ліпеня (1 жніўня) 1914 г., беларускія губерні былі пераведзены на ваеннае становішча. Быў устаноўлены жорсткі ваенна - паліцэйскі рэжым, забаронена дзейнасць палітычных партый, сходы і мітынгі. У', null, 2, 'Вызначце правільнае сцвярджэнне:', 1);
INSERT INTO eastory.questions (id, answer_1, answer_2, answer_3, answer_4, description, image, language_id, question, right_answer) VALUES (250, 'неадкладны выхад Расіі з Першай сусветнай вайны', 'стварэнне незалежнай беларускай дзяржавы', 'недавер да палітыкі Часовага ўрада', 'аўтаномію Беларусі ў складзе Расійскай федэратыўнай дэмакратычнай рэспублікі', 'Важную ролю ў развіцці беларускага нацыянальнага руху адыграў з''езд беларускіх нацыянальных арганізацый, які адбыўся ў сакавіку 1917 г. у Мінску. З''езд прыняў дэкларацыю ў падтрымку Часовага ўрада. Таксама ён выказаўся за аўтаномію Беларусі ў складзе Расе', null, 2, 'I з''езд беларускіх нацыянальных арганізацый, які адбыўся ў сакавіку 1917 г. у Мінску, выказаўся за:', 4);
